(126, 'ACCESSORIES', 'accessories', 'Have all your gal pals crushin on your style thanks to these fab fashion, home & beauty accessories fit for queens. A carefully chosen accessory can take you from average to serious slay in an instant. Stand out from your squad with these fierce women’s accessories including sassy hair accessories, bold belts, sunglasses & even home organizers. Add that extra something to casualwear to boost your OOTD or treat yourself to something sparkly to complete your OOTN. No matter what look you\'re vibin\', our accessories have got you covered babe', 'https://hautesignatures.com/images/category/q7aCZzlfaaBOGRjwElwGLZPCBTt1wdtRz00ye8UE.jpeg', NULL, '2020-10-27 15:11:20', '2020-12-15 20:32:46', 6, 'https://hautesignatures.com/products/accessories-organizers-storage', NULL, 0),
(127, 'JEWELRY', 'jewelry', 'IIt’s all in the details babe. Complete your look with the latest women’s jewelry to land on haute signatures - we’ve got the essential jewelry you need to take your look from basic to bold. Whether you want statement jewelry that’s the focal point of your outfit or subtle jewelry that adds the finishing touch you need, these latest fashion jewelry sets are here to up your accessorising game.', 'https://hautesignatures.com/images/category/bmw6a4viqPS5nNwwf1ZtTUT1m6D8qjf5PR5szwti.jpeg', NULL, '2020-10-27 15:12:14', '2020-12-15 20:33:43', 4, 'https://hautesignatures.com/products/jewelry-extra-pendants', NULL, 0),
(128, 'BAGS', 'bags', 'Meet the perfect plus one to your next event, we\'ve got something for you no matter the dress code. Store your everyday essentials the right way this season with our on-trend collection of women’s bags and purses. From owambe ready bags to large handbags for work, school and beyond, going out bags and everything in between, we\'re sure to have the perfect style to suit you. Add an on-trend baguette bag to a cycle shorts or jeans and an oversized tee combo for a weekend ready look. If extra is your vibe, choose embellished chain bags or ruched bag for those big night outs. Or opt for an ever versatile silver bag to add a premium feel to any look. Discover women\'s handbags to finish off any big deal occasion outfit, or choose from everyday bags that are both practical and on-point.', 'https://hautesignatures.com/images/category/V4QFL6BzP1ozcXDjdRBuBXDAPqFD3H9yrMsbIROU.jpeg', NULL, '2020-10-27 15:13:19', '2020-12-15 20:34:42', 3, 'https://hautesignatures.com/products/bags-featured-evening-bags-clutches', NULL, 0),
