(14, 'Accesories', 'accesories', NULL, '2020-04-30 15:40:00', '2020-10-27 17:35:55', 8, NULL, 'https://hautesignatures.com/products/accessories', 0, NULL, NULL, 0, NULL, '50', '50', NULL),
(16, 'About us', 'about-us', '<p><span style=\"font-size:10pt\">Hey girl, welcome to our world. We&rsquo;re Haute Signatures; our collections are stocked with you in mind.</span></p>\r\n\r\n<p><span style=\"font-size:10pt\">We curate sophisticated, chic and modern styles we know you&#39;ll love. We believe each style should be accessible to all, whatever your budget and we make fashion accessible and fun, so every girl can get the wardrobe of her dreams.</span></p>\r\n\r\n<p><span style=\"font-size:10pt\">One thing we love more than your amazing style is your individuality &ndash; we want to help you show it off, do your thing and look incredible at the same time.</span></p>\r\n\r\n<p><span style=\"font-size:10pt\">Our girl knows she can trust in us for everything she needs from the latest trend-led pieces to celebrity inspired looks, to the everyday wardrobe staples and that ultimate party piece.</span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"background-color:#ffffff\">Based in Lagos, Nigeria, we ship to all states in Nigeria with international shipping coming soon.</span></span></p>\r\n\r\n<ol>\r\n	<li style=\"list-style-type:decimal\"><span style=\"font-size:10pt\"><span style=\"background-color:#ffffff\">Find us on Facebook&nbsp; 											<a href=\"https://facebook.com/hautesignatures.ng/\" class=\"social-icon\" target=\"_blank\"><i class=\"fab fa-facebook-f\"></i></a>\r\n</span></span></li>\r\n	<li style=\"list-style-type:decimal\"><span style=\"font-size:10pt\"><span style=\"background-color:#ffffff\">Follow us on Instagram&nbsp; 											<a href=\"https://instagram.com/hautesignatures.ng?igshid=zqjic4sfh041\" class=\"social-icon\" target=\"_blank\"><i class=\"fab fa-instagram\"></i></a>\r\n</span></span></li>\r\n</ol>\r\n\r\n<p><span style=\"font-size:10pt\">We promise we&#39;ll do everything we can to make shopping with us a great experience! If you have any suggestions on how we can improve, please </span><a href=\"https://hautesignatures.com/pages/contact-us\" style=\"text-decoration:none\"><span style=\"font-size:10pt\"><u>let us know!</u></span></a></p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2020-04-30 15:44:35', '2020-12-06 17:51:54', 9, NULL, NULL, 0, NULL, NULL, 0, NULL, NULL, NULL, NULL),
(17, 'Shipping & Delivery', 'shipping-delivery', '<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Deliveries are within 1-3 working days of placing your order between the hours of 9am-6pm for Lagos orders and 2-5 working days for orders outside Lagos.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We also offer express delivery/next working day delivery to some areas within Lagos.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We will let you know the expected delivery day by email, account updates and/or phone, in some cases a signature may be required but If nobody is available when your parcel is delivered and there isn&rsquo;t a safe place to leave the parcel, the delivery driver will leave a calling card with instructions on how to rearrange delivery.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Kindly ensure you are up to date with details of your order to ensure successful delivery, if you will not be available within the delivery period, please let us know so we can reschedule.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">SEE DELIVERY CHARGES &amp; OPTIONS BELOW</span></span></p>\r\n\r\n<div class=\"col-12\">\r\n<div class=\"table-responsive\">\r\n<table class=\"table table-striped\" style=\"height:657px; width:712px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p><span style=\"font-size:18px\"><strong>DELIVERY OPTION</strong></span></p>\r\n			</td>\r\n			<td>\r\n			<p><span style=\"font-size:18px\"><strong>DELIVERY TIMEFRAME</strong></span></p>\r\n			</td>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:18px\"><strong>DELIVERY CHARGE</strong></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">STANDARD DELIVERY (Lagos Mainland &amp; Islandl)</span></span></span></td>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">Up to 3 working days</span></span></span></p>\r\n			</td>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">₦500 &amp;&nbsp;₦1000 respectively</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">STANDARD DELIVERY (Lagos far ends, outskirts &amp; borders)</span></span></span></p>\r\n			</td>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">Up to 3 working days</span></span></span></p>\r\n			</td>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">₦1500</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">CHOOSE A DELIVERY DAY (Lagos metropolis and central only)</span></span></span></td>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">Delivery is on a selected date, you can choose a delivery day of your choice, up to 10 days in advance (excluding next day delivery, Sundays and holidays)</span></span></span></p>\r\n			</td>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">₦1500</span></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">PICK UP (Magodo, Yaba &amp; Surulere)</span></span></span></p>\r\n			</td>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">Next Working day</span></span></span></p>\r\n			</td>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">₦200</span></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">EXPRESS DELIVERY (Lagos mainland excluding far ends, outskirts and borders)</span></span></span></td>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">Same day (If ordered before 12pm) or next day if ordered after 12pm</span></span></span></td>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">₦1000</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">EXPRESS DELIVERY (Lagos Island excluding far ends, outskirts and borders)</span></span></span></td>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">Same day (If ordered before 12pm) or next day if ordered after 12pm</span></span></span></td>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">₦1500</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">STANDARD DELIVERY</span></span></span></p>\r\n\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">(SOUTH WEST STATES - Ekiti, Ogun, Ondo, Osun, Oyo)</span></span></span></p>\r\n			</td>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">Up to 5 working days</span></span></span></td>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">₦2000</span></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">STANDARD DELIVERY (Abuja, Port Harcourt)</span></span></span></td>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">Up to 5 working days</span></span></span></td>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">₦2500</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">STANDARD DELIVERY ( Other states)</span></span></span></td>\r\n			<td><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">Up to 5 working days</span></span></span></td>\r\n			<td style=\"text-align:center\">\r\n			<p style=\"text-align:left\"><span style=\"font-size:8pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#434343\">₦3000</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<p>LAGOS FAR ENDS AND BORDER TOWNS INCLUDE: Ajah, Epe, Ibeju Lekki, Lakowe, Ikorodu, Badagry, Alakuko, Mile 2, Alaba, Trade fair, Alagbado, Ojo, Ipaja, Ayobo and their environs.</p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">NIGERIAN CAMPUSES OUTSIDE LAGOS (Orders ₦10000/more) ₦2000</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Please note that deliveries might be delayed due to public holidays, political unrest, force majeure or any other event beyond our control.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">PLEASE ENSURE YOU SELECT CORRECT DELIVERY FEE FOR YOUR LOCATION TO AVOID DELAYS TO YOUR ORDER BEING PROCESSED.</span></span></p>\r\n\r\n<h2><span style=\"font-size:16pt\"><span style=\"color:#434343\">RETURN POLICY</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We work hard at ensuring you derive utmost satisfaction from our products. However, should you notice a shipping error, damage or defect in your order, or will like to return for other reasons, kindly notify customer service within 48 hours of shipment delivery. We will arrange a pick-up at your convenience within 72 hours after you indicate a return request. Return Charges for shipping errors, damage or defects will be incurred by us while shipping/ delivery charges will be incurred by you on returns for other reasons.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">When a return request is made, two scheduled attempts within 72 hours will be made at your convenience. However, after 2 pick-up attempts, we will cancel the return procedure and you may not be able to return your product to us anymore.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Kindly check the size guide and/or product description to enable you to purchase the right product as we may not accept returns for these reasons. Cash refunds will only be granted if the item was received damaged, defective, does not correspond with the communicated description, is not delivered within the stipulated delivery time or as a result of any fault of ours. For other reasons, the value of the return items will be kept as store credits and can be used by the customer at any time.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&nbsp;We do not accept returns on gift cards, white colored products, jewelry, beauty and cosmetic products, sunglasses/glasses, underwear and sale/marked down products. Only wrongly delivered, damaged or defective items that fit into these categories will be considered for return and they must be in the Unused Condition.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">A notification will be sent to you once your return has been received and processed along with your credit information. Returns are processed within 1-5 business days from the date the package is received by us. Please note, Haut&eacute; Signatures does not refund shipping costs.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&nbsp;Please pack your return merchandise with care as Haut&eacute; Signatures will not take responsibility for items damaged due to improper packaging.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&bull; Returns must be received in new condition; unworn, unwashed, and with the hygienic liner and tags intact.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&bull; Items returned with obvious use, makeup, animal hair, dander, deodorant, perfume, or similar product stains may be subject to denial and sent back to you.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&bull; Shoes must be returned in their original shoe box and placed inside an additional box for shipping transit. Damage to the shoe box makes shoes ineligible for return.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&bull; Beauty &amp; Wellness products must be returned unused, in their original packaging, and with the seal unbroken.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&bull; Handbags &amp; Purses sold with a dust bag must be returned with their original dust bag.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&bull; Items sold as sets must be returned with the correct sizes, as sold.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&bull; If received damaged, items will be shipped back and subject to additional shipping costs.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&bull; Final Sale items cannot be returned for a refund.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&bull; Gift cards cannot be returned or refunded.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">If assessed and the product does not meet up to our return requirement, the product may be returned back to the sender and money not refunded. For office pickup orders, we advise that you pick up your order within 24-48 hours to be liable for an exchange or store credit refund. We can keep items for pick up in our warehouse indefinitely but the return window of 24-48 hours still applies.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">For more information, please send us a message during our business hours.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Monday through Friday 9am to 6pm and Saturdays 10am to 4pm (Excluding select holidays).</span></span></p>\r\n\r\n<p>&nbsp;</p>', '2020-04-30 15:45:12', '2020-12-17 21:08:13', 9, NULL, NULL, 0, NULL, NULL, 0, NULL, NULL, NULL, NULL),
(19, 'Contact Us', 'contact-us', '<h2><span style=\"font-size:10pt\"><span style=\"color:#434343\">Get in Touch</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Monday - Friday: 9am - 6pm</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Saturday: 10am - 4pm</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Sunday &amp; Public Holidays: CLOSED</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Customer Care &amp; General Enquiries: +234(0)92907541</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">&nbsp;Or <a href=\"https://wa.link/1on4j1\">WhatsApp</a> +234(0)92907541</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<form action=\"/contact/store\" method=\"post\">\r\n<div class=\"form-group required-field\">Name <input name=\"full_name\" required=\"required\" type=\"text\" /></div>\r\n\r\n<div class=\"form-group required-field\">Email <input name=\"email\" required=\"required\" type=\"email\" /></div>\r\n\r\n<div class=\"form-group required-field\">What&rsquo;s on your mind?<textarea cols=\"30\" name=\"message\" required=\"required\" rows=\"1\"></textarea></div>\r\n\r\n<div class=\"form-footer\">Submit</div>\r\n</form>\r\n</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>', '2020-04-30 15:46:00', '2020-12-17 21:11:49', 9, NULL, NULL, 0, NULL, NULL, 0, NULL, NULL, NULL, NULL),
(21, 'Privacy Policy', 'privacy-policy', '<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">This Privacy Policy applies to information collected by Haute Signatures (&ldquo;Haute Signatures, HS, Haute Global Company&rdquo;, &ldquo;we&rdquo;, &ldquo;our&rdquo; or &ldquo;us&rdquo;) in connection with the products and services that Haute Signatures offers online.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">This includes information collected online through our websites, branded pages on third party platforms (i.e., social networking services), and through our direct marketing campaigns or other online communications, as well as offline through our Sales Team, events, in-store campaigns, purchases, and requests, and mobile messaging services (collectively, &ldquo;Haute Signatures Platforms&rdquo;). This Privacy Policy explains what information may be collected through the Haute Signatures Platforms, how such information may be used and/or shared with others, how we safeguard it and how you may access and control its use in connection with our marketing communications and business activities. By using Haute Signatures Platforms, you agree to the collection, use, and disclosure of your information as described in this Privacy Policy. If you do not, please do not use Haute Signatures Platforms.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">This Privacy Policy is hereby incorporated into and forms part of the terms and conditions of use of Haute Signatures Platforms.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Information You Provide us</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">When you use Haute Signatures Platforms, we may ask you to provide certain personal information to obtain our products or use our services. For example, we may ask for information when you register to create an account, update your information, use certain features, access, upload or download content, purchase products or services, enter into sweepstakes or other promotions, register or participate in a competition, fill out a survey, request customer support, or otherwise communicate with us.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We (or our service providers or business partners) may collect information that relates to you, including personal information, such as your name, e-mail address, telephone number, phone number, mailing address, date of birth, gender, and demographic information.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Information You Provide When You Participate in an Online Survey or Other Research: We may also collect information you provide us in connection with participating in an online survey or as a research panel participant. This may include, but may not be limited to, information about your shopping habits, lifestyle preferences, interests and hobbies, health, physical or behavioral characteristics, or other demographic information, as well as photos, videos, and other user-generated content.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Information You Provide When You Make a Purchase: If you make a purchase from us, you will be required to provide a credit/debit card number and related financial information (such as CVV, expiration date, and billing address), or other payment information (such as via PayPal or Apple Pay), depending on the form of payment you choose.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Information You Provide about a Third Party: You may decide to provide us with another person&rsquo;s information (such as name, email, address, or phone number) so that we may recommend or send products or services to such person, or so that we may facilitate your communication with other people. Local law may require you to seek the consent of your contacts to provide their personal information to Haute Signatures (or in connection with using Haute Signatures Platforms), which may in turn use that information in accordance with the terms of this Privacy Policy. Where required by law, we will obtain the required consent from the person whose information you provided to us.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Information You Provide Through Social Media: You may also be given the option to link to your Facebook or other social media accounts through Haute Signatures Platforms. When you do, we may automatically receive certain information from you based upon your privacy settings on those sites. This may include, but may not be limited to, name, username, demographic information, updated address or contact information, location, interests, and publicly observed data, such as from social media and online activity.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Information Collected Automatically&nbsp;</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Whenever you visit or interact with the Haute Signatures services, as well as any third-party advertisers and/or service providers, may use a variety of technologies that automatically or passively collect information about your online activity. This information may be collected in the following ways:</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Information Usage: We may use cookies, pixel tags, mobile analytics software, log files, or other technologies to collect certain information about your online activity, and interactions with our emails, online and mobile advertisements, and to allow us to keep track of analytics and certain statistical information which enables Haute Signatures to improve the Haute Signatures Platforms and provide you with more relevant content and advertising offered by Haute Signatures or through or linked from the Haute Signatures Platforms.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">1. For example, we may automatically or passively collect certain non-personal information from you, including your browser type, mobile device manufacturer, mobile carrier, phone number, operating system, activations, content, products or services you purchase or access, the page served and the preceding page views or websites visited, any mobile device activity and configurations, and email client. We may also automatically collect information about your use of the Haute Signatures Platforms, including the date and time you visit the Haute Signatures Platforms, use or click through to any of the Haute Signatures Platforms, the areas or pages of the Haute Signatures Platforms that you visit, the amount of time you spend viewing or using the Haute Signatures Platforms, the number of times you return to the Haute Signatures Platforms, other click-stream or site usage data, emails that you open, forward or click-through to our Haute Signatures Platforms, and other sites that you may visit.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Device Information: We may automatically collect your IP address or other unique identifier (&ldquo;Device Identifier&rdquo;) for the computer, mobile device, tablet or other device (collectively, &ldquo;Device&rdquo;) you use to access Haute Signatures Platforms, including the hardware model and mobile network information. We may use a Device Identifier to, among other things, provide Haute Signatures Platforms, help diagnose problems with our servers, analyze trends, track users&rsquo; web page, email and mobile application movements/activities, help identify or gather broad demographic information for aggregate use, and retarget online and mobile advertisements to you across computers or devices you may use.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Geolocation Information: We may collect information about the location of your Device when you access or use Haute Signatures Platforms. In addition, if you choose to turn on your Bluetooth, Wi-Fi or other geolocation functionality when you use our mobile applications, we may collect and use your geolocation information.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Third Party Service Providers: We may use third party service providers to support Haute Signatures Platforms. Some of these service providers may use technology such as cookies, web beacons, pixel tags, log files, or other technologies to receive, collect, and store information on our behalf.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Third Party Analytic Technologies: We may use third parties&rsquo; analytics and tracking tools, such as Google Analytics, Facebook Custom Audience and others, to help us track, segment and analyze usage of Haute Signatures Platforms, and to help us or those third parties serve more targeted advertising to you on Haute Signatures Platforms and across the Internet. These tools may use technology such as cookies, pixel tags, log files, Flash cookies, or other technologies to collect and store non- personal information. They may also combine information they collect from your interaction with Haute Signatures with information they collect from other sources. We do not have access to, or control over, these third parties&rsquo; use of cookies or other tracking technologies. To learn more about your advertising choices relating to the collection and use of your information, please see the Opt-Out section below.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Information Received from Other Third Parties</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We may obtain information about you from other trusted third-party sources to update or supplement the information that you provide or that we collect automatically. This includes, for example, information from public databases or data aggregators that may include your demographic information, media consumption, previous purchases, shopping habits, loyalty program information or lifestyle preferences. We may also receive information about you from our partners and service providers, (including, for example, business partners, analytics vendors, advertising networks and search information providers).</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We may use this information to help us maintain the accuracy of the information we collect, personalize your experience with the Haute Signatures Platforms, target our communications so that we can inform you of products and services or other offers that may be of interest to you, to measure ad quality and responses, and for internal business analysis or other business purposes.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Combination of Information</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We may combine the information we receive from you and about you, including information you provide to us and information we automatically collect through the Haute Signatures Platforms, as well as information collected across other computers or devices that you may use, from other online or offline sources, and from third party sources. This combined information may be used in any manner detailed in this Privacy Policy.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">How we use the information collected</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We may use the information about you for a variety of business purposes, including for example:</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">For Customer Service and Transactional Purposes, such as to:</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Respond to your questions or requests and provide customer service;</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Manage your order and complete your order;</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Troubleshoot issues, bugs or defects related to your account or order;</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Provide you with access to certain features of Haute Signatures Platforms;</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Validate, confirm, verify, deliver, and track your order (including to arrange for shipping, handle returns and refunds, and contact you about your orders, including by email), and send you all purchases made on Haute Signatures.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Verify your identity or communicate with you about your activities with respect to Haute Signatures.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">To use and disclose your credit, debit or payment card or other financial information only to process payments and prevent fraud;</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Contact you with regard to your use of the Haute Signatures Platforms and, in our discretion, changes to any policy;</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Develop new products or services and to enhance current products and services;</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Protect the security or integrity of the Haute Signatures Platforms and our business, such as by protecting against and preventing fraud, unauthorized transactions, claims and other liabilities, and managing risk exposure, including by identifying potential hackers and other unauthorized users; and</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">For other purposes as disclosed at the time you provide your personal information or otherwise with your consent.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">For Advertising Customization and Analytics Purposes, such as to:</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Perform market research, understand the effectiveness of our competition or promotions and Haute Signatures Platforms analytics and operations; Personalize and improve the Haute Signatures Platforms and our products, services, offers and advertising made available on or outside the Haute Signatures Platforms (including on other sites/ applications that you visit). For example, we may provide personalized or localized content, recommendations, features, and provide content or features that match your interests and preferences;</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Provide you with customized content, advertisements, offers and promotions offered by Haute Signatures or on behalf of our partners and affiliates, and provide news and other information we think will be of interest to you on Haute Signatures Platforms, in emails and across third-party websites;</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Link or combine with information we receive from others to help understand your needs, use for interest-based or targeted advertising or retargeting on your computers or other devices, and to provide you with better service; and</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Communicate with you, either directly or through one of our partners (e.g., through Facebook Custom Audience and Google Customer Match, etc.) for Haute Signatures marketing and promotional purposes via emails, notifications, or other messages, consistent with any permissions you may have communicated to us.</span></span></p>\r\n\r\n<h3><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Sharing of Information</span></span></h3>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">The information collected or generated through your use of Haute Signatures Platforms may be shared by you or by us as described below.</span></span></p>\r\n\r\n<h2><span style=\"font-size:10pt\"><span style=\"color:#434343\">Sharing of Information by You</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Haute Signatures Platforms offer many ways to find, enjoy, and share content.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Your activity in connection with Haute Signatures Platforms, such as filling out surveys, reviewing and rating products, inquiring about or purchasing products, participation in online communities, &ldquo;liking&rdquo; or &ldquo;sharing&rdquo; Haute Signatures content to your social media accounts or pages or otherwise interacting with the Haute Signatures Platforms, may be visible to other users of Haute Signatures Platforms and in some cases, publicly available.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Sharing of Information by Us</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We may share the information collected from or about you in the following ways:</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">With Our Affiliates: We may share your information with our subsidiaries and affiliated companies for internal reasons, primarily for business and operational purposes.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Third Party Service Providers: We may share your information with third party service providers that provide business, professional or technical support functions on our behalf. This includes, but may not be limited to, service providers that host or operate the Haute Signatures Platforms; payment processors; analyze data; provide customer service; postal or delivery services, and sponsors or other third parties that participate in or administer any promotions.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Other Third Parties: Your information may also be shared with our sponsors, partners, advertisers, advertising networks, advertising servers, and analytics companies or other third parties in connection with marketing, promotional, and other offers, as well as product information. Your information may also be shared with third parties we identify at the time you provide your personal information or otherwise with your consent.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Sweepstakes, Contests, and Promotions: If you choose to enter into one of our sweepstakes, contests, or other promotions (a &ldquo;Promotion&rdquo;) we may disclose your information to third parties or the public in connection with the administration of such Promotion, as required by law, as otherwise permitted by the Promotion&rsquo;s official rules, or otherwise in accordance with the terms of this Privacy Policy.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Business Transfers: In the event that another entity acquires us or all or substantially all of our assets, or assets related to the Haute Signatures Platforms, your information may be disclosed to such entity as part of the due diligence process and will be transferred to such entity as one of the transferred assets. Also, if any bankruptcy or reorganization proceeding is brought by or against us, all such information may be considered an asset of ours and as such may be sold or transferred to third parties. Finally, information described in this paragraph may also be disclosed for due diligence purposes in connection with any proposed transaction of the sorts described in this paragraph.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Legal Disclosures; Safety: Haute Signatures may transfer and disclose your information to third parties to comply with a legal obligation; when we believe in good faith that the law requires it; at the request of governmental authorities conducting an investigation; to verify or enforce our Terms of Service or other applicable policies; to detect and protect against fraud, or any technical or security vulnerabilities; to respond to an emergency; or otherwise to protect the rights, property, safety, or security of third parties, users of the Haute Signatures Platforms, or the public.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Aggregate or Anonymous Non-Personal Information: We may also share aggregate or anonymous non- personal information with third parties for their marketing or analytics uses.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Opt-out</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Certain parts of the Haute Signatures Platforms require cookies. You are free to set your browser or operating system settings to limit certain tracking or to decline cookies, but by doing so, you may not be able to use certain features through the Haute Signatures Platforms or take full advantage of all of our offerings. Please refer to your Web browser&rsquo;s or operating system&rsquo;s website or &ldquo;Help&rdquo; section for more information on how to delete and/or disable your browser or operating system from receiving cookies or controlling your tracking preferences. On your mobile device, you may also adjust your privacy and advertising settings to control whether you want to receive more relevant advertising.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Our system may not respond to Do Not Track requests or headers from some or all browsers. We may use cookies or other technologies to deliver more relevant advertising and to link data collected across other computers or devices that you may use.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We, or other parties we do business with, may place or recognize unique cookies or other technologies on your browser when you visit the Haute Signatures Platforms to collect information about your use of the Haute Signatures Platforms and your other online activities over time and across different websites and apps, and may use that information to serve interest-based advertisements to you as you browse the Internet.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">To learn how to manage privacy and storage settings for Flash cookies, please visit https://www.adobe.com/support/documentation/en/flashplayer/help/settings_manager.html.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Access and Updates to Your Information</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">If you wish to verify, correct, or update any of your personal information, you may contact us at info@hautesignatures.com</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We provide our customers with the opportunity to update their information or opt-out of having their information used for purposes not directly related to placement, processing, fulfillment, or delivery of a product order or servicing of your product. To opt-out of marketing communications, you may:</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Send us an e-mail at info@hautesignatures.com or unsubscribe from our marketing email communications at any time by unsubscribing or following the instructions contained within the email.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Children&rsquo;s privacy</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Protecting children&rsquo;s privacy is important to us. We do not direct the Haute Signatures Platforms to, nor do we knowingly collect any personal information from, children under the age of 13. If Haute Signatures learns that a child under the age of thirteen has provided personally identifiable information through the Haute Signatures Platforms, we will use reasonable efforts to remove such information from our files.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Security of information</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We use certain reasonable security measures to help protect your personal information. However, no electronic data transmission or storage of information can be guaranteed to be 100% secure. Please note that we cannot ensure or warrant the security of any information you transmit to us. You use the Haute Signatures Platforms and provide us with your information at your own risk. If we share information with a third party, as detailed in this privacy policy, we shall use all reasonable efforts to ensure that they keep the information secure and only use the information consistent with the terms of this Privacy Policy.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Other sites</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">The Haute Signatures website may contain links to other sites that we do not own or operate. This includes links from service providers, fulfilment companies, advertisers, sponsors, or other business partners that may use our logo(s) as part of a co-branding agreement. We are not responsible for these sites or their content, products, services or privacy policies or practices. These other web sites may send their own cookies to your Device, they may independently collect data or solicit personal information and may or may not have their own published privacy policies. You should also independently assess the authenticity of any site which appears or claims that it is one of the Haute Signatures (including those linked to through an email or social networking page).</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Changes and other Haute Signatures privacy policies</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Any changes we may make to our Privacy Policy will be posted on this page. Please check back frequently to see any updates or changes to our Privacy Policy. If you do not agree or consent to these updates or changes, do not continue to use the Haute Signatures Platforms. If we make a material change to this Privacy Policy, we will provide appropriate notice to you.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">In addition to this Privacy Policy, there may be specific campaigns or promotions which will be governed by additional privacy terms or policies. We encourage you to read these additional terms or policies before participating in any such campaigns or promotions as you will be required to comply with them if you participate. Any additional privacy terms or policies will be made prominently available to you.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Contact us</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">If you have any questions or concerns regarding this Privacy Policy, please contact us at:</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Re: HAUTE SIGNATURES</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Email: <u>info@hautesignatures.com</u></span></span></p>', '2020-04-30 15:46:29', '2020-11-23 23:17:09', 10, NULL, NULL, 0, NULL, NULL, 0, NULL, NULL, NULL, NULL),
