34343\">If we decide to change our privacy policy, we will post those changes on this page.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Contacting us</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">If you have any questions or comments about these Terms of Use or this site, please contact us by email: info@hautesignatures.com</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">This site is owned and operated by</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Haute Signatures.</span></span></p>', '2020-05-03 15:05:55', '2020-11-23 23:21:20', 10, 1, NULL, 0, NULL, NULL, 0, NULL, NULL, NULL, NULL),
