(301, 'ALICE POINTED-TOE PUMPS', 'alice-pointed-toe-pumps', NULL, 0, NULL, NULL, NULL, NULL, '<p>There just isn&#39;t another quite like the Alice Pointed-Toe Pumps!</p>\r\n\r\n<ul>\r\n	<li>PU Leather</li>\r\n	<li>Cushioned Insole</li>\r\n	<li>3.5 inches heel</li>\r\n	<li>Brand: Weide</li>\r\n</ul>', 2, NULL, 'iDvxzx', NULL, 2, 1, 0, 1, '2020-10-27 22:55:08', '2020-12-12 14:42:14', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'PUMPS/COURT SHOE,Low Heel,Corporates,Beige,38'),
(304, 'AMANDINE OPEN TOE LOW HEEL MULES', 'amandine-open-toe-low-heel-mules', NULL, 0, NULL, NULL, NULL, NULL, '<p>Go ahead and stun&nbsp;the world once you go out in the <u>Amndine Open Toe low heel mules</u></p>\r\n\r\n<p>PU Leather</p>\r\n\r\n<p>Cushioned Insole</p>\r\n\r\n<p>1.5 Inches heel</p>\r\n\r\n<p>Brand: She &amp; IN</p>', 2, NULL, 'eQTTgt', NULL, 1, 1, 0, 1, '2020-10-28 02:30:51', '2020-12-15 17:19:44', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Heeled Mules,Low Heel,Casual,Black,38'),
(305, 'ARLO VINYL CROC EMBOSSED BLOCK HEEL MULES', 'arlo-vinyl-croc-embossed-block-heel-mules', NULL, 0, NULL, NULL, NULL, NULL, '<p>Arlo Vinyl Croc Embossed Block Heel Mules are a classic style with a bit of sexy flair!</p>\r\n\r\n<ul>\r\n	<li>&nbsp;</li>\r\n	<li>PU Leather</li>\r\n	<li>Cushioned Insole</li>\r\n	<li>4 inches heel</li>\r\n	<li>Brand: She &amp; in</li>\r\n</ul>', 2, NULL, 'KrjU1n', NULL, 1, 1, 0, 1, '2020-10-28 04:57:44', '2020-12-12 15:03:03', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Heeled Mules,High Heel,Party,Nude,38'),
(308, 'BONITA  BOW DETAILED POINTED-TOE FLAT', 'bonita-bow-detailed-pointed-toe-flat', NULL, 0, NULL, NULL, NULL, NULL, '<p>Stroll down the street feeling better than ever in the Bonita Bow detailed pointed toe flats&nbsp;</p>\r\n\r\n<p>PU Leather&nbsp;</p>\r\n\r\n<p>0.2 inche rubberheel</p>\r\n\r\n<p>cushioned insole</p>\r\n\r\n<p>nonskid rubber sole</p>\r\n\r\n<p>Brand:Primavera</p>', 2, NULL, 'pt7b1m', NULL, 1, 1, 0, 1, '2020-10-28 22:41:21', '2020-12-15 16:18:27', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'POINTY TOE,Flat,Corporates,40,Black,Beige,36'),
(309, 'BRETTA BLOCK HEEL MULES', 'bretta-block-heel-mules', NULL, 0, NULL, NULL, NULL, NULL, '<p>Walk into any room with confidence when you&#39;re wearing The Bretta Multicolored Block Heel Mules</p>\r\n\r\n<ul>\r\n	<li>PU Leather</li>\r\n	<li>Man made material</li>\r\n	<li>Cushioned Insole</li>\r\n	<li>2 inches heel</li>\r\n	<li>Brand: Moda</li>\r\n</ul>', 2, NULL, 'v42R7S', NULL, 2, 1, 0, 1, '2020-10-28 23:20:25', '2020-12-12 21:17:21', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Heeled Mules,Low Heel,Party,Multicolor,38'),
(310, 'BRINLEY PEARL DETAILED COVER SHOE', 'brinley-pearl-detailed-cover-shoe', NULL, 0, NULL, NULL, NULL, NULL, '<p>The Brinley Pearl Detailed Cover shoe is a bold basic that you&#39;ll want to wear again and again.</p>\r\n\r\n<ul>\r\n	<li>PU Leather</li>\r\n	<li>Man made material</li>\r\n	<li>Cushioned Insole</li>\r\n	<li>1 inch heel</li>\r\n	<li>Brand: Xenia Essential</li>\r\n</ul>', 2, NULL, 'icGdPP', NULL, 2, 1, 0, 1, '2020-10-28 23:36:01', '2020-12-12 14:31:49', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'COVER SHOE,Low Heel,Corporates,Black,38'),
(311, 'CABELLA POINTED-TOE SLINGBACK PUMP', 'cabella-pointed-toe-slingback-pump', NULL, 0, NULL, NULL, NULL, NULL, '<p>Cabella Pointed-Toe slingback Pump are so sylish, you&#39;ll want to wear them day and night&nbsp;</p>\r\n\r\n<ul>\r\n	<li>PU Leather&nbsp;</li>\r\n	<li>Cushioned insole</li>\r\n	<li>2 inches Heel</li>\r\n	<li>Buckle fastening&nbsp;</li>\r\n	<li>Brand:Tatra</li>\r\n</ul>', 2, NULL, 'FlVlRe', NULL, 2, 1, 0, 1, '2020-10-29 00:00:37', '2020-12-15 16:54:01', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'PUMPS/COURT SHOE,Mid Heel,Corporates,41,Beige,Black,37'),
(312, 'CALICE ANKLE STRAP FLAT SANDALS', 'calice-ankle-strap-flat-sandals', NULL, 0, NULL, NULL, NULL, NULL, '<p>Walk with purpose with the Calice Ankle Strap Flat Sandals</p>\r\n\r\n<ul>\r\n	<li>PU Leather</li>\r\n	<li>0.5 inche rubber heel</li>\r\n	<li>Buckle strap fastening</li>\r\n	<li>Cushioned Insole</li>\r\n	<li>Nonskid Rubber sole</li>\r\n	<li>Brand:Rock &amp; Candy by Zigi&nbsp;</li>\r\n</ul>', 2, NULL, 'Snj7Hk', NULL, 1, 1, 0, 1, '2020-10-29 01:59:59', '2020-12-15 16:26:19', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'FLAT SANDALS,Flat,Casual,Black,37'),
(313, 'CARMELLA THREE TONED SLIDES', 'carmella-three-toned-slides', NULL, 0, NULL, NULL, NULL, NULL, '<p>Keep things chic all season long with the Carmella Three toned Slides.</p>\r\n\r\n<ul>\r\n	<li>PU Leather</li>\r\n	<li>0.25 inches rubber heel.</li>\r\n	<li>Cushioned insole.</li>\r\n	<li>Nonskid rubber sole.</li>\r\n	<li>Brand: MS</li>\r\n</ul>', 2, NULL, 'exSR8r', NULL, 1, 1, 0, 1, '2020-10-29 03:14:39', '2020-12-13 17:29:13', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'SLIDES,Flat,Casual,Multicolor,36'),
(314, 'CASSIDY CROC EMBOSSED LOW HEEL SHOE', 'cassidy-croc-embossed-low-heel-shoe', NULL, 0, NULL, NULL, NULL, NULL, '<p>From work to play, let the Cassidy Black Croc Embossed Low Heel Shoe add some chic deets to your day.</p>\r\n\r\n<ul>\r\n	<li>Croc Embossed PU Leather</li>\r\n	<li>Cushioned Insole</li>\r\n	<li>0.5 inch heel</li>\r\n	<li>Brand: Reserved</li>\r\n</ul>', 2, NULL, 'yMmHL2', NULL, 4, 1, 0, 1, '2020-10-29 10:13:05', '2020-12-12 14:35:22', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'COVER SHOE,Low Heel,Corporates,Black,39'),
(315, 'CECEE BOW DETAILED BALLET FLATS', 'cecee-bow-detailed-ballet-flats', NULL, 0, NULL, NULL, NULL, NULL, '<p>Cecee Bow Detailed Ballet Flats are a wear-everywhere wonder!</p>\r\n\r\n<ul>\r\n	<li>PU Leather</li>\r\n	<li>0.25 inch rubber heel.</li>\r\n	<li>Cushioned insole.</li>\r\n	<li>Nonskid rubber sole.</li>\r\n	<li>Brand: FPC (Fashion Private Company)</li>\r\n</ul>', 2, NULL, 'qgrU1E', NULL, 1, 1, 0, 1, '2020-10-29 10:28:33', '2020-12-12 14:49:43', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'BALLET,Flat,Corporates,Black,38'),
(316, 'CHELSIE DETAILED POINTED FLATS', 'chelsie-detailed-pointed-flats', NULL, 0, NULL, NULL, NULL, NULL, '<p>Elevate your office attire with the Chelsie Snakeskin detailed pointed Flats!</p>\r\n\r\n<ul>\r\n	<li>PU Leather</li>\r\n	<li>0.25 inch rubber heel.</li>\r\n	<li>Cushioned insole.</li>\r\n	<li>Nonskid rubber sole.</li>\r\n	<li>Brand: Lapierce</li>\r\n</ul>', 2, NULL, 'T2kA6f', NULL, 2, 1, 0, 1, '2020-10-29 10:44:52', '2020-12-14 15:19:41', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'BALLET,Flat,Corporates,Navy Blue,38'),
(317, 'CLARA QUILTED SQUARE TOE HIGH HEEL MULES', 'clara-quilted-square-toe-high-heel-mules', NULL, 0, NULL, NULL, NULL, NULL, '<p>The Clara Quilted Square Toe High Heel Mules are all the rage.</p>\r\n\r\n<ul>\r\n	<li>PU Leather</li>\r\n	<li>Cushioned insole</li>\r\n	<li>4 inches Heel</li>\r\n	<li>Brand: She &amp; in</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 2, NULL, 'jD8b1p', NULL, 1, 1, 0, 1, '2020-10-29 11:41:09', '2020-12-17 16:48:11', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Heeled Mules,High Heel,Party,Brown,38'),
(322, 'DANNAY OPEN TOE SLING BACK BLOCK HEELS', 'dannay-open-toe-sling-back-block-heels', NULL, 0, NULL, NULL, NULL, NULL, '<p>Put your best foot forward in the&nbsp;Dannay Open Toe Sling Back Block Heels</p>\r\n\r\n<ul>\r\n	<li>PU Leather&nbsp;</li>\r\n	<li>Cushioned Insole</li>\r\n	<li>2.5 inches Heel</li>\r\n	<li>Buckle fastening&nbsp;</li>\r\n	<li>Brand:Dorathy Perkins</li>\r\n</ul>', 2, NULL, 'jhE1cm', NULL, 2, 1, 0, 1, '2020-10-29 16:46:16', '2020-12-12 14:53:02', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'SLINGBACK,Mid Heel,Party,Gold,38'),
(323, 'DOROTHEA CROSS OPEN TOE MID HEEL MULES', 'dorothea-cross-open-toe-mid-heel-mules', NULL, 0, NULL, NULL, NULL, NULL, '<p>We love the flirty look of the Dorothea Cross Open Toe Mid Heel Mules!</p>\r\n\r\n<ul>\r\n	<li>PU Leather</li>\r\n	<li>Cushioned Insole</li>\r\n	<li>2.5 inches heel</li>\r\n	<li>Curved Heel</li>\r\n	<li>Brand: She &amp; in</li>\r\n</ul>', 2, NULL, 'dGA8tD', NULL, 1, 1, 0, 1, '2020-10-29 17:54:35', '2020-12-12 14:55:34', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Heeled Mules,Mid Heel,Party,Yellow,38'),
(324, 'ELLAROSE CROC EMBOSSED ANKLE STRAP PUMP', 'ellarose-croc-embossed-ankle-strap-pump', NULL, 0, NULL, NULL, NULL, NULL, '<p>Show off your wild side with the Ellarose Croc Embossed Ankle Strap Pump.</p>\r\n\r\n<ul>\r\n	<li>PU Leather</li>\r\n	<li>Buckle strap Fastening</li>\r\n	<li>2.5 inches heel</li>\r\n	<li>Brand: Rossi</li>\r\n</ul>', 2, NULL, '4ZmIGO', NULL, 2, 1, 0, 1, '2020-10-29 18:21:27', '2020-12-15 21:08:01', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'POINTY TOE,Low Heel,Corporates,Beige,38'),
(326, 'EMMA STRAPPY SANDALS', 'emma-strappy-sandals', NULL, 0, NULL, NULL, NULL, NULL, '<p>Give your outfit the final finishing touch that it deserves with the Emma Strappy Sandals.</p>\r\n\r\n<ul>\r\n	<li>PU Leather</li>\r\n	<li>3.5 inches Heel</li>\r\n	<li>buckle Fastening</li>\r\n	<li>Brand: Dorathy Perkins&nbsp;</li>\r\n</ul>', 2, NULL, 'yO5qhc', NULL, 2, 1, 0, 1, '2020-10-29 19:17:20', '2020-12-16 21:20:14', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'HEELED SANDALS,Mid Heel,Party,Nude,38'),
