(346, 'LOVE DETAILED LAPTOP BAG', 'love-detailed-laptop-bag', NULL, 0, NULL, NULL, NULL, NULL, '<p>Protect your laptop in style&mdash;get this snug, lightweight love detailed laptop bag! To prevent any scratch marks, it contains an internal padded zipper and its interior is fully lined with faux fur.</p>\r\n\r\n<ul>\r\n	<li>Padded Interior</li>\r\n	<li>PU Leather</li>\r\n	<li>Luggage/Trolley Sleeves</li>\r\n	<li>Inner Pockets &amp; compartments<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 2, NULL, 't6IaKa', NULL, 5, 1, 1, 1, '2020-10-31 08:18:21', '2020-12-17 19:22:29', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Green,13.3/14'),
(347, 'MAPLE LEAF DETAILED LAPTOP BAG', 'maple-leaf-detailed-laptop-bag', NULL, 0, NULL, NULL, NULL, NULL, '<p>Want to achieve an effortless dapper/chic look whilst keeping your laptop safe and protected, look no further, shop the maple leaf print detailed laptop bag. It will fit effortlessly into every wardrobe.</p>\r\n\r\n<ul>\r\n	<li>Padded Interior</li>\r\n	<li>Oxford Canvas</li>\r\n	<li>Luggage/Trolley Sleeves</li>\r\n	<li>Inner Pockets &amp; compartments<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'UztHt7', NULL, 2, 1, 1, 1, '2020-10-31 08:39:37', '2020-12-17 20:09:20', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '13.3,14/15'),
(348, 'MERIDIAN LAPTOP BAG', 'meridian-laptop-bag', NULL, 0, NULL, NULL, NULL, NULL, '<p>Your do-it-all bag. The Meridian laptop bag can carry you through even your most packed schedule&mdash;laptop included. This structured bag will always make you look polished, from your morning commute to an evening nightcap.</p>\r\n\r\n<ul>\r\n	<li>Padded Interior</li>\r\n	<li>PU Leather</li>\r\n	<li>Inner Pockets &amp; compartments</li>\r\n	<li>Long Adjustable strap<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'wCtTbh', NULL, 6, 1, 1, 0, '2020-10-31 08:46:28', '2020-12-17 19:18:53', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Pink,13.3/14'),
(349, 'QUILTED DETAILED 2 IN 1 LAPTOP BAG', 'quilted-detailed-2-in-1-laptop-bag', NULL, 0, NULL, NULL, NULL, NULL, '<p>The quilted detailed 2 in 1 laptop bag has a rich internal structure and other comparmeents to store your books, files, phone, and other smaller accessories, it offers you visible softness and invisible delicacy</p>\r\n\r\n<ul>\r\n	<li>Pedded interior</li>\r\n	<li>Oxford Canvas</li>\r\n	<li>inner Pockets &amp; compartments</li>\r\n	<li>Lightweight</li>\r\n</ul>', 2, NULL, 'vNYh8i', NULL, 6, 1, 1, 1, '2020-10-31 09:09:49', '2020-12-17 19:26:03', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Navy Blue,13.3/14'),
(352, 'SLOGAN LAPTOP BAG', 'slogan-laptop-bag', NULL, 0, NULL, NULL, NULL, NULL, '<p>Who doesnt love a funny slogan? The slogan print laptop bag is Sophisticated yet practical. It&#39;s fitted with a hide-able handle for your comfort.</p>\r\n\r\n<ul>\r\n	<li>Padded Interior</li>\r\n	<li>PU Leather</li>\r\n	<li>Luggage/Trolley Sleeves</li>\r\n	<li>Inner Pockets &amp; compartments<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'Df4yH0', NULL, 5, 1, 1, 1, '2020-11-03 02:38:06', '2020-12-17 19:24:45', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Blue,13.3/14'),
(353, 'SOPH LAPTOP BAG', 'soph-laptop-bag', NULL, 0, NULL, NULL, NULL, NULL, '<p>Our Soph laptop bag is functional, elegant, and comfortable for a professional woman/man on the go. It opens up to a padded roomy interior &amp; multiple inner compartments for your other gadgets and even a book!</p>\r\n\r\n<ul>\r\n	<li>Padded Interior</li>\r\n	<li>Oxford Canvas</li>\r\n	<li>Waterproof</li>\r\n	<li>Inner Pockets &amp; compartments</li>\r\n	<li>Luggage/Trolley sleeves<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'SNaaG4', NULL, 2, 1, 0, 1, '2020-11-03 02:55:54', '2020-12-17 19:54:35', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Grey,13.3'),
(354, 'SUNFLOWER  DETAILED LAPTOP BAG', 'sunflower-detailed-laptop-bag', NULL, 0, NULL, NULL, NULL, NULL, '<p>With the sunflower print detailed laptop bag, you&#39;ll bring a modern-day fashionable style to office outfits. Slip it over your shoulder while commuting and switch to the handles once you arrive at work. Use it to carry your Laptop, notebook and tablet as you dash between meetings.</p>\r\n\r\n<ul>\r\n	<li>Padded Interior</li>\r\n	<li>Oxford Canvas</li>\r\n	<li>Luggage/Trolley Sleeves</li>\r\n	<li>Inner Pockets &amp; compartments</li>\r\n	<li>Long adjustable strap<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'uOb0kx', NULL, 2, 1, 1, 1, '2020-11-03 03:08:23', '2020-12-17 19:57:06', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Black,13.3'),
