(357, 'SO CLASSY RECTANGULAR SHAPED RHINESTONE DETAILED SHOE CLIP', 'so-classy-rectangular-shaped-rhinestone-detailed-shoe-clip', 4000, 0, NULL, NULL, NULL, NULL, '<p>This So classy rectanglular shaped rhinestone detailed shoe clip is one of its kind. Its a reliable and cost-effective way to give your shoes a facelift. Great for high heels and ballerinas, it can be clipped both on the front or side of the shoe!</p>\r\n\r\n<ul>\r\n	<li>Material: Copper &amp; Crystal rhinestone</li>\r\n	<li>Size: Width 6cm, Height: 4cm</li>\r\n	<li>Weight: 26g</li>\r\n</ul>', 2, NULL, 'FlpdiN', NULL, 2, 1, 0, 0, '2020-11-03 16:05:20', '2020-12-13 19:41:44', NULL, 0, NULL, NULL, 'https://hautesignatures.com/images/products/hsCo0R95VRtSoP7LDRxXXtHNIaa4olYIro9lZGMW.jpeg', NULL, NULL, 'simple', 0, ''),
