(441, 'DOUBLE CIRCLE BAMBOO BUCKLE BELT', 'double-circle-bamboo-buckle-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>With twice the trendy hardware, the HS Double Buckle bamboo detailed Belt will have you looking truly divine! This Genuine leather belt is versatile as can be and boasts a matte gold double buckle.</p>\r\n\r\n<ul>\r\n	<li>Material: Cow Hide</li>\r\n	<li>Closure: Pin</li>\r\n	<li>Dimension: L 110cm by 2.5cm</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, '5B8tej', NULL, 16, 1, 0, 1, '2020-11-28 06:04:33', '2020-12-14 15:07:52', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'WAIST/HIP,Black,Light Brown'),
(442, 'NAYA STITCH DETAILED BELT', 'naya-stitch-detailed-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>The HS Naya Stitch Detailed Black Leather Belt is an instant classic! Supple genuine leather shapes this classically stylish belt that has a slightly distressed look and a matte silver, circular buckle. This belt is perfect for pairing with all your favorite jeans and pants.</p>\r\n\r\n<ul>\r\n	<li>Material: Cow hide</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 106cm W 2.5cm</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, 'x6X5Vg', NULL, 24, 1, 0, 1, '2020-11-28 06:08:29', '2020-12-12 21:17:51', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'HIP,Black'),
(443, 'STUDDED DETAILED RETRO BELT', 'studded-detailed-retro-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>Set a stylish movement into motion with the HS Studded detailed Retro Black Belt! This wide genuine leather belt has a U-Shaped silver buckle; If you aren&#39;t already linking this belt up with your jeans, we suggest you start pretty soon!</p>\r\n\r\n<ul>\r\n	<li>Material: Cow hide</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 108cm W 3cm</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, 'WtIQXL', NULL, 24, 1, 0, 1, '2020-11-28 06:11:57', '2020-12-12 21:17:23', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'HIP,Black'),
(444, 'DOUBLE C MINIMALIST BELT', 'double-c-minimalist-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>Finish off your look in style with the HS Double C Minimalist Buckle Belt! Luxe genuine leather shapes this minimal chic belt with a shiny silver double buckle.</p>\r\n\r\n<ul>\r\n	<li>Material: Cow hide</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 107cm W 3cm</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, 'mQEeC8', NULL, 23, 1, 0, 1, '2020-11-28 06:27:29', '2020-12-12 21:18:34', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'HIP,Black,Light Brown'),
(445, 'TWIST LOOP BUCKLE SKINNY BELT', 'twist-loop-buckle-skinny-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>Add some chic, classic vibes to your look with the HS Twist Loop Buckle Skinny Belt! This on-trend belt is shaped from soft geninue leather and features a matte gold loop closure. Wear with your fave high-waisted jeans or use it to create a chic cinched look over a dress or jumpsuit.</p>\r\n\r\n<ul>\r\n	<li>Material: Cow hide</li>\r\n	<li>Closure: Loop</li>\r\n	<li>Dimension: L 107cm W 1cm</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, 'pfUXKa', NULL, 24, 1, 0, 1, '2020-11-28 06:47:41', '2020-12-12 21:19:27', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'WAIST,Black,Light Brown'),
(446, 'WESTERN STYLE INSPIRED BELT', 'western-style-inspired-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>Get ready to saddle up with HS Western Buckle Detailed Belt! Geninue shapes this Western Style inspired belt with it&#39;s engraved silver buckle and tip. This trendy belt can be paired with jeans or your favorite maxi dress!</p>\r\n\r\n<ul>\r\n	<li>Material: Cow hide</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 104cm W 2cm</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, 'KZHhf9', NULL, 24, 1, 0, 1, '2020-11-28 06:51:07', '2020-12-12 21:19:56', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'WAIST/HIP,Black'),
(447, 'TWO TONED TRIANGLE BUCKLE BELT', 'two-toned-triangle-buckle-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>An adventure wouldn&#39;t be complete without the HS Two toned Triangle Buckle Belt! Two interlocked triangle shaped buckles, one in gold and one in silver sit at the center of this trendy and adjustable genuine leather belt</p>\r\n\r\n<ul>\r\n	<li>Material: Cow hide</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 87cm W 2cm</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, 'hBVJVb', NULL, 24, 1, 0, 1, '2020-11-28 06:58:39', '2020-12-12 21:20:31', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'WAIST/HIP,Black,Light Brown'),
(448, '3 PACK PEARL BUCKLE BELT', '3-pack-pearl-buckle-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>Never settle for less than the best! The HS Pearl Detailed Buckle Belt Set is sure to outshine the rest with its trio of Faux leather belts in shades of black, brown, and green. Pearl buckles on each one lend an unexpectedly chic finish.</p>\r\n\r\n<ul>\r\n	<li>Material: PU (Faux Leather)</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 98cm W 1.5cm</li>\r\n	<li>One size fits UK 6 - 12</li>\r\n</ul>', 2, NULL, '5FyMQr', NULL, 12, 1, 0, 1, '2020-11-28 07:32:26', '2020-12-13 21:09:19', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'WAIST/HIP,Multicolor'),
(449, '3 PACK VARIANT BUCKLE BELT SET', '3-pack-variant-buckle-belt-set', NULL, 0, NULL, NULL, NULL, NULL, '<p>With the HS Variety Multi Belt Set, you&#39;ll always have the perfect accessory for the day! This fun mixed belt set features a Pink Belt belt with a gold sqaure buckle, a black studded belt with a gold ROUND buckle, and a Grey belt with a gold U-shaped buckle, all formed by faux leather.</p>\r\n\r\n<ul>\r\n	<li>Material: PU (Faux Leather) and Rubber</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 100cm W 1.5cm</li>\r\n	<li>One size fits UK 6 - 12</li>\r\n</ul>', 2, NULL, 'qGKFQZ', NULL, 12, 1, 0, 1, '2020-11-28 07:36:21', '2020-12-13 21:09:59', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'WAIST/HIP,Multicolor'),
(450, 'ELENA SQUARE HEAD MINIMALIST SLIM BELT', 'elena-square-head-minimalist-slim-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>With the HS Elena Minimalist belt, you&#39;re sure of classy and stylish accessories for the day! This exciting belt set features a gold round pin closure, a gold square pin closure , and a gold rectangular buckle, all formed by a black faux leather.</p>\r\n\r\n<ul>\r\n	<li>Material: PU (Faux Leather)</li>\r\n	<li>Closure: Pin</li>\r\n	<li>Dimension: L 100cm W 1.5cm</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, 'L5Kkox', NULL, 12, 1, 0, 1, '2020-11-28 07:43:06', '2020-12-12 21:24:11', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'WAIST/HIP,Black,Black'),
(451, 'ELENA OBLONG HEAD MINIMALIST SLIM BELT', 'elena-oblong-head-minimalist-slim-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>With the HS Elena Minimalist belt, you&#39;re sure of classy and stylish accessories for the day! This exciting belt set features a gold round pin closure, a gold square pin closure , and a gold rectangular buckle, all formed by a black faux leather.</p>\r\n\r\n<ul>\r\n	<li>Material: PU (Faux Leather)</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 100cm W 1.5cm</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, '6FJ43b', NULL, 12, 1, 0, 1, '2020-11-28 07:46:06', '2020-12-12 21:22:54', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'WAIST/HIP,Black'),
(452, 'CELIA CHAIN DETAILED BELT', 'celia-chain-detailed-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>Cinch in your look with the HS Celia Chain Detailed belt. Featuring a gold chunky chain, wear over a shirt dress or a pair of Jeans for an exquisite look.</p>\r\n\r\n<ul>\r\n	<li>Material: Copper</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 102cm W 1cm</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, 'zQuEL8', NULL, 7, 1, 0, 1, '2020-11-28 07:50:38', '2020-12-12 21:25:03', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'WAIST/HIP,Gold,Silver'),
(453, 'TRIANGLE DECOR BUCKLE BELT', 'triangle-decor-buckle-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>Don&#39;t let this unique belt slither away! The HS single Triangle buckle Belt will add a delightfully edgy touch to any outfit with its uniquely textured faux leather body and gold triangle shaped buckle.</p>\r\n\r\n<ul>\r\n	<li>Material: PU (Faux Leather)</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 114cm W 1cm</li>\r\n	<li>One size fits UK 6 - 12</li>\r\n</ul>', 2, NULL, 'YS76kG', NULL, 12, 1, 0, 1, '2020-11-28 07:55:45', '2020-12-12 21:25:40', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'WAIST,Black,Brown'),
(454, 'ANIMAL PRINT BELT', 'animal-print-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>Nothing is going to stop you when you&#39;re choosing from the HS Animal Print Belt. This Faux leather belt features three trendy belts: A Tiger print belt, A cheetah print belt and a Snakeskin print Belt, all with gold plated buckles. Pick and choose for whichever mood you&#39;re in!</p>\r\n\r\n<ul>\r\n	<li>Material: PU (Faux Leather)</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 101cm W 2cm</li>\r\n	<li>One size fits UK 6 - 12</li>\r\n</ul>', 2, NULL, 'WAq8L0', NULL, 12, 1, 0, 1, '2020-11-28 08:07:56', '2020-12-12 21:26:33', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'HIP,Beige,Brown'),
(455, 'DOUBLE CIRCLE BUCKLE BELT', 'double-circle-buckle-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>No other accessory in our collection even comes close to the effortless elegance of the HS Double Circle Buckle Belt! PU (Faux) leather forms a sleek, wide belt with a statement-making gold double circle buckle.</p>\r\n\r\n<ul>\r\n	<li>Material: PU (Faux Leather)</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 102cm W 1.7cm</li>\r\n	<li>One size fits UK 6 - 12</li>\r\n</ul>', 2, NULL, 'aXQZUs', NULL, 24, 1, 0, 1, '2020-11-28 08:17:20', '2020-12-12 21:27:34', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'HIP,Black,White'),
(456, 'CASSIE MULTI-HOLED STITCH DETAILED BELT', 'cassie-multi-holed-stitch-detailed-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>Add some luxe to your look with this hip belt. Comprises of several colours with black buckles; we&#39;re obsessed. Style on a pair of Jeans and you&#39;re good to go</p>\r\n\r\n<ul>\r\n	<li>Material: PU (Faux Leather)</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 105cm W 2.3cm</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, 'Jr7abl', NULL, 12, 1, 0, 1, '2020-11-28 08:23:27', '2020-12-12 21:28:27', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'HIP,DARK BROWN,Light Brown'),
(457, 'MARIAH EYELET BELT', 'mariah-eyelet-belt', NULL, 0, NULL, NULL, NULL, NULL, '<p>Keep your look on-point this season with this statement belt. Featuring faux leather strap belts with eyelet detailing, it&#39;s perfect for cinching in any outfit.</p>\r\n\r\n<ul>\r\n	<li>Material: PU (Faux Leather)</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 112cm W 2cm</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, 'YOBYMY', NULL, 10, 1, 0, 1, '2020-11-28 08:31:32', '2020-12-12 21:29:37', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'HIP,Beige,Black'),
(458, '3 PACK SLIM BELT SET', '3-pack-slim-belt-set', NULL, 0, NULL, NULL, NULL, NULL, '<p>Looking to add a little somethin&#39; somethin&#39; to your fit? Look no further than the HS Slim Multi Belt Set! This trendy belt set features three vegan Faux leather skinny belts in Cheetah Print, Plain black, and snake print. Belts have shiny gold buckles.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Material: PU (Faux Leather)</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L 100cm W 1.5cm</li>\r\n	<li>One size fits UK 6 - 10</li>\r\n</ul>', 2, NULL, 'hGeCxs', NULL, 12, 1, 0, 1, '2020-11-29 04:45:25', '2020-12-13 21:10:44', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'WAIST/HIP,Multicolor'),
(461, 'DOUBLE CIRCLE CROC SHOULDER BAG', 'double-circle-croc-shoulder-bag', NULL, 0, NULL, NULL, NULL, NULL, '<p>Store all of your essentials in style with this must-have bag.</p>\r\n\r\n<ul>\r\n	<li>&quot;Material: PU Leather</li>\r\n	<li>Size: L 27cm, H 11cm, W 6cm&quot;<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'olIam1', NULL, 5, 1, 0, 1, '2020-12-01 17:38:15', '2020-12-13 19:48:15', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Baguette,Croc embossed,Chain strap,Off White,Small/Mini'),
(462, 'GEO SQUARE CUFF BANGLE', 'geo-square-cuff-bangle', NULL, 0, NULL, NULL, NULL, NULL, '<p>Shine bright with the Geo Square cuff bangle as your guide! Gold metal shapes an open cuff silhouette with large and small square-shaped charms at the ends, both giving a chic glam to the wrist.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, 'Ud3Ioe', NULL, 10, 1, 0, 1, '2020-12-02 08:07:14', '2020-12-12 17:22:26', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(463, 'GEO TRIANGLE CUFF BANGLE', 'geo-triangle-cuff-bangle', NULL, 0, NULL, NULL, NULL, NULL, '<p>Stand out with the Geo triangle cuff bangle as you go! Gold metal shapes an open cuff silhouette with large and small triangle-shaped black coloured charms at both ends.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, 'HUddmI', NULL, 9, 1, 0, 1, '2020-12-02 08:15:30', '2020-12-12 17:20:08', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(464, 'GEO BALL CUFF BANGLE', 'geo-ball-cuff-bangle', NULL, 0, NULL, NULL, NULL, NULL, '<p>Steal the day with the Geo ball cuff bangle! Gold metal shapes an open cuff silhouette with large and small cylinder-shaped gold coloured charms at both ends. For a simple, yet classy glam, this should be your go to bangle</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, '1XVIwT', NULL, 10, 1, 0, 1, '2020-12-02 08:20:30', '2020-12-12 17:21:00', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(465, 'CHIC FREE SIZE RING', 'chic-free-size-ring', NULL, 0, NULL, NULL, NULL, NULL, '<p>Slay in style with the HS free sized rings! Suitable for sizes 6 to 8, just adjust slightly to your fit and you&#39;re good.</p>\r\n\r\n<ul>\r\n	<li>Material: Gold Plated Copper</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, 'zSmdcA', NULL, 4, 1, 0, 1, '2020-12-02 08:29:22', '2020-12-16 21:22:52', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Gold,DESIGN 1'),
(466, 'HEX MALACHITE MINIMALIST JEWELRY SET', 'hex-malachite-minimalist-jewelry-set', NULL, 0, NULL, NULL, NULL, NULL, '<p>With the Hex Malachite Jewellry set comprising of a necklace, bangle and earring, you&#39;re sure to make heads turn at your next event. Copper gold material all detailed with hexagon shaped green coloured gems. We hope you add this to your collection soon.</p>\r\n\r\n<ul>\r\n	<li>Material: Copper</li>\r\n	<li>Closure: Earring - Post back, Bangle- Open, Necklace - Lobster clasp closure</li>\r\n</ul>', 2, NULL, '0SGmpE', NULL, 2, 1, 0, 1, '2020-12-02 08:37:40', '2020-12-16 21:25:53', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Gold,Free Size'),
(467, 'LUCY SQUARE GREEN MALACHITE  NECKLACE', 'lucy-square-green-malachite-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>The striking design features a hand cut Malachite gemstone set in an copper silver pendant on a short bobble chain. The bright green Malachite crystal is known for having transformational powers.</p>\r\n\r\n<ul>\r\n	<li>Material: Copper</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'xBz3UT', NULL, 5, 1, 0, 1, '2020-12-02 09:36:03', '2020-12-16 21:30:04', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Silver,Free Size'),
(468, 'LUCY SQUARE WHITE MALACHITE  NECKLACE', 'lucy-square-white-malachite-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>The striking design features a hand cut white coloured Malachite gemstone set in an copper silver pendant on a short bobble chain.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The striking design features a hand cut white coloured Malachite gemstone set in an copper gold pendant on a short bobble chain.</p>\r\n\r\n<ul>\r\n	<li>Material: Copper</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'bRReRi', NULL, 5, 1, 0, 1, '2020-12-02 18:36:13', '2020-12-16 21:32:09', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Silver,Free Size'),
(469, 'MARIAH LAYERED NECKLACE & EARRING SET', 'mariah-layered-necklace-earring-set', NULL, 0, NULL, NULL, NULL, NULL, '<p>Bring the bling with you wherever you go with the Mariah Layered Necklace! A trio of glistening gold chain with a small cross pendant and a chain with interlocking circles creates a stunning layered array while a single cross bigger pendant dangles from the longest layer.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless Steel</li>\r\n	<li>Closure: Earring - Post back, Necklace - Lobster clasp closure</li>\r\n</ul>', 2, NULL, 'zXkicB', NULL, 20, 1, 0, 1, '2020-12-02 18:58:29', '2020-12-16 21:35:46', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(470, 'FREDA GEM STUD YELLOW STONE', 'freda-gem-stud-yellow-stone', NULL, 0, NULL, NULL, NULL, NULL, '<p>A new ear stack essential. The HS Gem stud earrings comes in a single Opalite stone with several exciting colours embedded in Silver and gold copper. Style them with your favorite mini hoops or let them shine on their own.<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Material: Copper</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'GH28t3', NULL, 20, 1, 0, 1, '2020-12-02 19:57:21', '2020-12-16 15:11:50', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Silver,6MM'),
(471, 'FREDA GEM STUD BLUE STONE', 'freda-gem-stud-blue-stone', NULL, 0, NULL, NULL, NULL, NULL, '<p>A new ear stack essential. The HS Gem stud earrings comes in a single Opalite stone with several exciting colours embedded in Silver and gold copper. Style them with your favorite mini hoops or let them shine on their own.</p>\r\n\r\n<ul>\r\n	<li>Material: Copper</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'Xdy9Nu', NULL, 10, 1, 0, 1, '2020-12-02 23:01:17', '2020-12-16 15:09:26', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Gold,6MM'),
