(477, 'AMY CHUNKY MINI HOOPS', 'amy-chunky-mini-hoops', NULL, 0, NULL, NULL, NULL, NULL, '<p>Go bigger and bolder - the Amy Chunky Hoops are a must have. They&#39;ll add a cool vintage-inspired feel to your everyday looks with their plaited design and statement silhouette.</p>\r\n\r\n<ul>\r\n	<li>Material: Copper</li>\r\n	<li>Closure: Hinged back</li>\r\n</ul>', 2, NULL, '5JYeTj', NULL, 5, 1, 0, 1, '2020-12-03 00:07:38', '2020-12-16 21:40:23', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Gold,Free Size'),
(478, 'CELINE CHUNKY MINI HOOPS', 'celine-chunky-mini-hoops', NULL, 0, NULL, NULL, NULL, NULL, '<p>Taking inspiration from Colombia, the Celine copper gold hoops add some shine to any outfit. With their light-reflecting textured finish, these hoops are designed to gently hug the ear lobe.</p>\r\n\r\n<ul>\r\n	<li>Material: Copper</li>\r\n	<li>Closure: Hinged back</li>\r\n</ul>', 2, NULL, 'lJFXCE', NULL, 5, 1, 0, 1, '2020-12-03 00:16:56', '2020-12-16 21:42:14', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Gold,Free Size'),
(479, 'CIARA GEM DETAILED MINI HOOPS', 'ciara-gem-detailed-mini-hoops', NULL, 0, NULL, NULL, NULL, NULL, '<p>These gorgeous hoop earrings are the celestial pair you have been dreaming of. Carefully handcrafted and artistically engraved, these hoop earrings feature a cubic zirconia gem. Medium-sized and classy, these gold hoops with a gem stones are ideal for everyday wear</p>\r\n\r\n<ul>\r\n	<li>Material: Copper</li>\r\n	<li>Closure: Hinged back</li>\r\n</ul>', 2, NULL, '5tpWwK', NULL, 10, 1, 0, 1, '2020-12-03 08:43:28', '2020-12-16 21:58:58', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Gold,Free Size'),
(480, 'MINIMALIST MATTE GOLD HOOP', 'minimalist-matte-gold-hoop', NULL, 0, NULL, NULL, NULL, NULL, '<p>Re-vamp your accessory game with the Minimalist Gold Hoop Earrings! These essential earrings are shaped from matte gold metal that forms a slender hoop silhouette. Perfect to pair with any classic outfits from a simple tee and jeans to an LBD</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Hinged back</li>\r\n</ul>', 2, NULL, 'J1Tb3a', NULL, 5, 1, 0, 1, '2020-12-03 08:53:43', '2020-12-16 22:02:30', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Small'),
(482, 'KNOT DETAILED JEWELRY SET', 'knot-detailed-jewelry-set', NULL, 0, NULL, NULL, NULL, NULL, '<p>Glam yourself up in our Knot detailed Jewellry set. this set features a cuff bangle, a cute dangling pair of earrings and an adjustable free sized ring. All made of stainless steel in gold colour; you shouldn&#39;t miss this!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Earring - Post back, Ring &amp; Bangle- Open.</li>\r\n</ul>', 2, NULL, 'Cq4ddm', NULL, 4, 1, 0, 1, '2020-12-03 09:10:08', '2020-12-16 22:09:16', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(483, 'SALLY LARGE SIZED HOOPS', 'sally-large-sized-hoops', NULL, 0, NULL, NULL, NULL, NULL, '<p>Make a statement with the Sally Large sizes Hoops They&#39;re impactful worn both alone or teamed with other smaller styles.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'LqeDbv', NULL, 5, 1, 0, 1, '2020-12-03 11:39:03', '2020-12-16 22:11:14', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Big'),
(484, 'SALLY MIDI SIZED HOOPS', 'sally-midi-sized-hoops', NULL, 0, NULL, NULL, NULL, NULL, '<p>You can never go wrong with a staple piece like the Sally Medium sized Hoop Earrings! These darling hoop earrings are shaped from shiny gold metal and have a unique layered design. These minimalist hoops are sure to complement any look!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'CIDTDF', NULL, 5, 1, 0, 1, '2020-12-03 11:44:50', '2020-12-16 22:14:01', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,MEDIUM'),
(485, 'SALLY MINI SIZED HOOPS', 'sally-mini-sized-hoops', NULL, 0, NULL, NULL, NULL, NULL, '<p>A striking update to your favorite mini hoops, the Sally mini Hoops are a standout piece in the collection. Designed to be worn as a signature piece, the detail will add depth to all your looks.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'nr2L0S', NULL, 4, 1, 0, 1, '2020-12-03 14:02:12', '2020-12-16 22:15:26', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Small'),
(486, 'FLOWER DETAILED STUDS', 'flower-detailed-studs', NULL, 0, NULL, NULL, NULL, NULL, '<p>A new ear stack essential! These delicate studs feature a floral detail in rosegold with a pretty pearl/gem sitted at its center. Style them with your favorite mini hoops and huggies, or let them shine solo.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'X7kY7X', NULL, 10, 1, 0, 1, '2020-12-03 21:01:58', '2020-12-10 19:39:49', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(488, 'BUTTERFLY DETAILED NECKLACE', 'butterfly-detailed-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>This beautiful Butterfly necklace features a sturdy rosegold chain and a sleek butterfly pendant with a minimal design. Add a hip vibe to your outfit by wearing this rosegold necklace with a pair of mismatched earrings, a chunky cuff bracelet, and your favorite crop jeans. You are ready to rock!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'UR69TH', NULL, 10, 1, 0, 1, '2020-12-03 21:35:35', '2020-12-16 22:17:31', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(489, 'HEART DETAILED RHINESTONE STUD', 'heart-detailed-rhinestone-stud', NULL, 0, NULL, NULL, NULL, NULL, '<p>A new ear stack essential. Our heart detailed design gets an update in these simple-but-striking rosegold stud earrings crafted with stainless steel. Style them with your favorite hoops or let them shine on their own</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'hgE8Jg', NULL, 10, 1, 0, 1, '2020-12-04 04:42:06', '2020-12-10 19:40:43', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(490, 'LARA RN EARRING & NECKLACE JEWELRY SET', 'lara-rn-earring-necklace-jewelry-set', NULL, 0, NULL, NULL, NULL, NULL, '<p>Enjoy a very special Rosegold jewelry set (Necklace + Studs). You can wear this stunning set with a black velvet wrap dress, a pair of stiletto shoes and a thin black or rosegold bangle. Wear your hair up in a sleek ponytail and don&rsquo;t forget to put on a Red lipstick. Get this unique set to instantly upgrade your look!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless Steel</li>\r\n	<li>Closure: Earring - Post back, Necklace - Lobster clasp closure</li>\r\n</ul>', 2, NULL, 'Y1ceT4', NULL, 10, 1, 0, 1, '2020-12-04 04:45:52', '2020-12-16 22:19:04', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(491, 'LOVE DROP DOUBLE CHAIN ANKLET', 'love-drop-double-chain-anklet', NULL, 0, NULL, NULL, NULL, NULL, '<p>Your new summer go-to. The love Drop double chain anklet is crafted with rosegold stainless steel and features a heart shaped droplet on one of it&#39;s chains</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'z89PCL', NULL, 10, 1, 0, 1, '2020-12-04 04:49:05', '2020-12-12 19:40:32', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(492, 'FLORAL AND BALL DETAILED ANKLET', 'floral-and-ball-detailed-anklet', NULL, 0, NULL, NULL, NULL, NULL, '<p>Don&#39;t leave your ankles out. Adorn them with this simple anklets in rosegold and silver variants for effortless contemporary cool. Its floral and ball details give the perfect glam to your ankles.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'rqqty2', NULL, 5, 1, 0, 1, '2020-12-04 04:53:45', '2020-12-12 19:39:52', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,Free Size'),
(493, 'SINGLE CROSS CHAIN ANKLET', 'single-cross-chain-anklet', NULL, 0, NULL, NULL, NULL, NULL, '<p>Adorn your ankle with this Single Cross Chain Anklet. Featuring a snake chain design with a crucifix rosegold stainless steel, stack with other of your faves for a unique look.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'HKL8qn', NULL, 10, 1, 0, 1, '2020-12-04 05:00:28', '2020-12-12 19:39:17', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(494, 'BOW AND GEM DETAILED NECKLACE', 'bow-and-gem-detailed-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Bring a bit of good luck everywhere you go in the HS Bow and Gem necklace These features a dainty chain in rosegold and gold stainless steel with clear gem stones.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'Hls89c', NULL, 5, 1, 0, 1, '2020-12-04 05:04:53', '2020-12-16 22:21:32', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(495, 'DOUBLE HEART INTERLOCK NECKLACE', 'double-heart-interlock-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>The HS Double Heart Interlock Necklace is out of this world cute! This adorable necklace features a rosegold stainless steel chain with a silver and black pendant and a silver stainless steel chain with rosegold and silver encrusted with tiny clear shimmers/glitters.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'ACkQsY', NULL, 5, 1, 0, 1, '2020-12-04 05:24:27', '2020-12-16 22:23:36', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Black,Free Size'),
(496, 'V SHAPED NECKLACE', 'v-shaped-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>The HS V-Shaped Necklace adds the perfect amount of dainty detail to every outfit! Shiny rosegold, gold and silver color option shapes this must-have necklace that has a cute triangle charm. This minimalist necklace is perfect by itself or for layering with others!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'Q1zlqb', NULL, 5, 1, 0, 1, '2020-12-04 05:30:31', '2020-12-16 22:55:43', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(497, 'V SHAPED GEM DETAILED NECKLACE', 'v-shaped-gem-detailed-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>The HS Rosegold V-Shaped Gem Detailed Drop Necklace is the perfect addition to any outfit! A minimal, stainless steel chain features a shiny triangle charm and a dramatic drop chain.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'KAtQFf', NULL, 10, 1, 0, 1, '2020-12-04 05:37:11', '2020-12-16 22:57:45', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(498, 'KEY TO THE HEART NECKLACE', 'key-to-the-heart-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Hold the key to your heart close with this heart lock necklace combining two romantic charms on a Rosegold chain. With a classic link chain, a gorgeous pendant and a shimmering cubic zirconia gem embedded in the key, this adorable heart lock necklace is a must-have. Looks fabulous with blouses and dresses with V-necklines.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, '441d8N', NULL, 2, 1, 0, 1, '2020-12-04 07:18:43', '2020-12-16 23:00:50', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,Free Size'),
(499, 'BALL DETAILED HORN INSPIRED NECKLACE', 'ball-detailed-horn-inspired-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Level up your jewelry box with this beautiful rosegold pendant necklace. With a delicate ball link chain and a creative sculptural horn-like pendant, this chain necklace adds a subtle and classy brilliance to your style. Match its sleek, glossy look with a cashmere turtleneck in a solid color, a vibrant plaid skirt and those suede boots you can&rsquo;t wait to try</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'gVGMzD', NULL, 2, 1, 0, 1, '2020-12-04 07:24:43', '2020-12-17 07:03:35', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,Free Size'),
(500, 'BUTTERFLY RESIN DECOR  NECKLACE AND EARRING SET', 'butterfly-resin-decor-necklace-and-earring-set', NULL, 0, NULL, NULL, NULL, NULL, '<p>It&#39;s all about accessories for injecting individuality into your look and the Butterfly Resin Decor Necklace and Earring set is the perfect accessory for you. Can be worn as an everyday accessory and also for special events.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless Steel</li>\r\n	<li>Closure: Earring - Post back, Necklace - Lobster clasp closure</li>\r\n</ul>', 2, NULL, 'KjU3DP', NULL, 10, 1, 0, 1, '2020-12-04 07:28:12', '2020-12-17 07:05:00', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(501, 'PADLOCK DROP EARRINGS', 'padlock-drop-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Customize your ear game by fastening on these safety pin earrings crafted in 100% Stainless Steel. These Padlock drop earrings are great to wear on their own or stack with other earrings. Experiment with your style and up your jewelry game with these must-have earrings.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'krPB6C', NULL, 4, 1, 0, 1, '2020-12-04 07:33:49', '2020-12-17 07:06:28', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(502, 'MATTE FINISH PADLOCK PENDANT NECKLACE', 'matte-finish-padlock-pendant-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>This beautifully-crafted padlock necklace holds the key to a bold fashion statement. Made of quality stainless steel, this necklace adds a contemporary edge to your style. Wear this gold or rosegold padlock necklace alone or stacked with other chain necklaces for a statement layered look.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'NeEmgQ', NULL, 3, 1, 0, 1, '2020-12-04 07:40:24', '2020-12-16 14:33:19', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size');
