(503, 'MINI SHINNY PADLOCK PENDANT NECKLACE', 'mini-shinny-padlock-pendant-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>This beautifully-crafted padlock necklace holds the key to a bold fashion statement. Made of quality stainless steel, this necklace adds a contemporary edge to your style. Wear this gold or rosegold padlock necklace alone or stacked with other chain necklaces for a statement layered look.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'Z7858c', NULL, 3, 1, 0, 1, '2020-12-04 07:47:56', '2020-12-16 14:28:13', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(504, 'DOUBLE BAR PADLOCK PENDANT NECKLACE', 'double-bar-padlock-pendant-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>This beautifully-crafted padlock necklace holds the key to a bold fashion statement. Made of quality stainless steel, this necklace adds a contemporary edge to your style. Wear this gold or rosegold padlock necklace alone or stacked with other chain necklaces for a statement layered look.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'oXAtr2', NULL, 3, 1, 0, 1, '2020-12-04 09:50:37', '2020-12-16 14:25:46', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(505, 'LOVE DETAILED HOOPS', 'love-detailed-hoops', NULL, 0, NULL, NULL, NULL, NULL, '<p>With a clean, pared-down aesthetics, these gorgeous heart shaped gold hoop earrings can be worn to any and every occasion. Feel fabulous in your new summer dress by completing your look with a new pair of these thick yet lightweight gold hoops.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Hinge back</li>\r\n</ul>', 2, NULL, 'Z8Iedw', NULL, 10, 1, 0, 1, '2020-12-04 09:58:13', '2020-12-10 22:26:40', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(507, 'PEARL AND RING DETAILED EARRINGS', 'pearl-and-ring-detailed-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>The HS Pearl and Ring detailed earrings are so chic that &quot;luxury&quot; will be your new middle name! A pearl sits at the top of the circle shaped earrings and four shiny smaller rings dangle at the bottom .</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'adxYc0', NULL, 4, 1, 0, 1, '2020-12-04 13:44:58', '2020-12-14 18:13:50', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
