(509, 'SAFETY PIN EARRINGS', 'safety-pin-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Secure a great sense of style with these safety pin earrings crafted in 100% stainless steel. Unique and lightweight, these safety pin earrings will add a statement to any ear stack.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'oiHzPu', NULL, 3, 1, 0, 1, '2020-12-04 14:08:46', '2020-12-17 13:47:30', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(510, 'HS HEART SHAPED & RHINESTONE EARRINGS', 'hs-heart-shaped-rhinestone-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Take a ring around the rosie with a pair of heart-shaped earrings that are sure to nip your outfit troubles in the bud. Perfect for frolicking in a meadow or sprucing up literally any look.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>\r\n\r\n<p><br />\r\n&nbsp;</p>', 2, NULL, 'R0Pbo6', NULL, 10, 1, 0, 1, '2020-12-04 14:13:22', '2020-12-11 14:37:39', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(511, 'TWO HEARTS CUFF BANGLE', 'two-hearts-cuff-bangle', NULL, 0, NULL, NULL, NULL, NULL, '<p>Let Love lead with the HS Two hearts Bracelet as your guide! Silver, Gold and Rosegold stainless steel metal shapes an open cuff silhouette with 2 heart-shaped charms at the ends.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, 'YM8mxf', NULL, 3, 1, 0, 1, '2020-12-04 14:19:51', '2020-12-17 13:50:14', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(512, 'BRAIDED CUFF BANGLE', 'braided-cuff-bangle', NULL, 0, NULL, NULL, NULL, NULL, '<p>Glam it up like you&#39;re a movie star with the Braided Cuff Bangle! Shiny patterened metal shapes this glam bracelet. This bracelet comes in a variety of gold, silver and rosegold colours.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, 'ETfOXF', NULL, 5, 1, 0, 1, '2020-12-04 14:36:50', '2020-12-17 13:52:42', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(513, 'CHIC MINIMALIST BANGLE', 'chic-minimalist-bangle', NULL, 0, NULL, NULL, NULL, NULL, '<p>Add that perfect finishing touch to any look with the Chic Minimalist Cuff Bracelet! Shiny Stainless steel ovals come together to shape this cuff bracelet that can be worn alone or layered in a fun stack.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Catch</li>\r\n</ul>', 2, NULL, 'JHp9HY', NULL, 8, 1, 0, 1, '2020-12-04 14:44:17', '2020-12-17 14:02:51', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(514, 'SMILEY AND GEM BANGLE', 'smiley-and-gem-bangle', NULL, 0, NULL, NULL, NULL, NULL, '<p>If you&#39;re looking for a sign, here it is; The HS Smiley and Gem Bangle Bracelet. Two circle shaped circles, the bigger one with a black smiley charm, and the smaller with a dazzling gem meet in a parallel form at both ends Shiny gold, silver and rosegold shapes this dainty bracelet that features an adjustable wrap design.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, 'gOuVfq', NULL, 8, 1, 0, 1, '2020-12-04 14:50:07', '2020-12-17 14:12:15', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,Free Size'),
(515, 'BOW AND RHINESTONE DETAILED BANGLE', 'bow-and-rhinestone-detailed-bangle', NULL, 0, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Catch</li>\r\n</ul>', 2, NULL, 'RMlFKm', NULL, 8, 1, 0, 1, '2020-12-04 14:56:38', '2020-12-17 14:18:37', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(516, 'MARTHA 2 LAYERED CHAIN BRACELET', 'martha-2-layered-chain-bracelet', NULL, 0, NULL, NULL, NULL, NULL, '<p>Become the center of everyone&#39;s attention when you put on the HS Martha 2 Layered Chain Bracelet! This double-layered bracelet has one layer of plain gold, silver or rosegold chains while the 2nd layer boasts a plain chain with a symbol detailed charm.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'huTvNy', NULL, 2, 1, 0, 1, '2020-12-04 15:02:15', '2020-12-11 15:44:57', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,Free Size'),
(517, 'KATHY CRISS-CROSS CUFF BANGLE', 'kathy-criss-cross-cuff-bangle', NULL, 0, NULL, NULL, NULL, NULL, '<p>Hey, girl, hey! We&#39;re always looking for an opportunity to greet the Kathy criss-cross Bangle! This cute bangle has a criss-cross wave design that looks great on a beach vacay!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, 'VE8VxX', NULL, 2, 1, 0, 1, '2020-12-04 15:08:29', '2020-12-17 14:22:37', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,Free Size'),
(518, 'TWIRL DETAILED NECKLACE AND EARRING JEWELRY SET', 'twirl-detailed-necklace-and-earring-jewelry-set', NULL, 0, NULL, NULL, NULL, NULL, '<p>Enjoy a very special jewelry set (Necklace + Earrings) featuring 100% Stainless steel in a variety of three colours . You can wear this stunning set with a black wrap dress, a pair of high-heeled Mules and a thin bangle</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless Steel</li>\r\n	<li>Closure: Earring - Post back, Necklace - Lobster clasp closure</li>\r\n</ul>', 2, NULL, 'U1ncuM', NULL, 2, 1, 0, 1, '2020-12-04 15:21:44', '2020-12-14 18:12:03', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,Free Size'),
(519, 'STAR AND MOON LAYERED NECKLACE', 'star-and-moon-layered-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Create a cohesive look by pairing the Star and Moon Gold Layered Necklace with your other gold accessories! This lovely layered necklace features a simple chain with three dainty star charms and another simple chain with a crescent moon pendant. Love it and it will love you back! Remove before exercising or showering, and when applying scents, lotions and sprays.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'fLwco3', NULL, 12, 1, 0, 1, '2020-12-04 15:25:57', '2020-12-16 15:57:13', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(520, 'OPEN ENDS TWIST HOOPS', 'open-ends-twist-hoops', NULL, 0, NULL, NULL, NULL, NULL, '<p>Our Gold Open Ends Twist Hoops feature a soft curve design and a polished steel. They&#39;re striking enough to wear solo, but versatile to team with other earrings.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'ZAckrm', NULL, 12, 1, 0, 1, '2020-12-04 15:33:50', '2020-12-17 16:43:12', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(521, 'DOUBLE LAYERED LINK UP AND RHINESTONE NECKLACE', 'double-layered-link-up-and-rhinestone-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Two pieces from our Collection, the Gold Link Up and Silver Plain Chain Necklace form a striking duo with contrasting links.<br />\r\nLayer for less, with pieces that make an unbeatable team.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'm1O5Zi', NULL, 12, 1, 0, 1, '2020-12-04 15:39:46', '2020-12-16 15:55:14', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(522, 'TONIA LAYERED HOLLOW PENDANT NECKLACE', 'tonia-layered-hollow-pendant-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>This money-saving layering Necklace set pairs a plain chain which has a dangling closed circle charm with another chain which has a bigger open circle charm. Style together and feel the magic.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'qEhzuU', NULL, 12, 1, 0, 1, '2020-12-04 15:44:06', '2020-12-16 15:49:20', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(523, 'HS KING STATEMENT EARRINGS', 'hs-king-statement-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>HS Exclusive! The King Statement Earrings will have you feeling like the King that you are! These cute and lightweight stainless steel earrings feature a simply chic &quot;KING&quot; charm with a Dangling chain. Wear individually or with a simple pair of studs.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'rQcE93', NULL, 6, 1, 0, 1, '2020-12-04 15:49:23', '2020-12-17 16:44:49', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(524, 'LOVE CUT OUT EARRINGS', 'love-cut-out-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Accessorize your outfit in the best way with the Love cut out Earrings! These cute little earrings feature a trendy cut out heart-shaped charm.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'HPRXQQ', NULL, 6, 1, 0, 1, '2020-12-04 15:56:25', '2020-12-17 16:46:46', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(525, 'CHUNKY CHAIN AND COIN LAYERED NECKLACE', 'chunky-chain-and-coin-layered-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Day or night, the chunky Chain and Coin Layered Necklace Set is here to make your outfit perfect! This necklace set features a sleek textured chain, accented with coin pendant and a chunky chain necklace in gold settings throughout. Layered together or worn alone, this set is sure to stun!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n	<li>&nbsp;</li>\r\n</ul>', 2, NULL, 'uWPowo', NULL, 40, 1, 0, 1, '2020-12-04 16:01:39', '2020-12-17 16:49:16', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(526, 'LINK UP CHAIN AND PEARL LAYERED NECKLACE', 'link-up-chain-and-pearl-layered-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>The complementarity between the link chain necklace and the simple polished chain with a dropping pearl charm makes this necklace set a must-have for your jewelry collection.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, '9GjTJQ', NULL, 20, 1, 0, 1, '2020-12-04 16:16:14', '2020-12-16 15:39:40', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(527, 'ABSTRACT FACE DETAILED EARRINGS', 'abstract-face-detailed-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Looking like a classy girl isn&rsquo;t as difficile as it seems. Consider the Abstract Human face detailed earrings to make all your dreams come true.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'Ck8jfU', NULL, 20, 1, 0, 1, '2020-12-04 16:20:50', '2020-12-11 16:50:08', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(528, 'SWEET BUTTERFLIES LAYERED NECKLACE', 'sweet-butterflies-layered-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Prepare to covet the HS Sweet Butterflies Necklace! This gorgeous, dainty necklace has a chain and matching butterfly charms that have a sweet appeal to the eyes. Layer up with your fave plain necklaces or wear alone for a simple yet striking look!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'The42J', NULL, 10, 1, 0, 1, '2020-12-04 16:29:37', '2020-12-17 18:01:33', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(529, 'PEARL AND ANCHOR NECKLACE', 'pearl-and-anchor-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Show your love for pearls every single day with this delicate &amp; gorgeous pearl necklace. Versatile and dainty, this gold necklace features a durable gold chain with an anchor charm beautifully sited at its side and a dropping pearl. Have fun styling this fab pearl necklace with gold statement earrings, an A-line navy dress, and colorful sandal.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, '7n8ewl', NULL, 6, 1, 0, 1, '2020-12-04 16:37:02', '2020-12-17 18:03:19', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(530, 'TEDDY BEAR STUDS', 'teddy-bear-studs', NULL, 0, NULL, NULL, NULL, NULL, '<p>These teddy bear studs in stainless steel have an effortless edge. Pair them with a gemstone hoops or wear them on their own for simple statement.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, '7Oni7A', NULL, 6, 1, 0, 1, '2020-12-04 16:43:40', '2020-12-11 16:52:22', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(531, 'LEXI CHUNKY HOOPS', 'lexi-chunky-hoops', NULL, 0, NULL, NULL, NULL, NULL, '<p>The Lexi Chunky hoops are a vintage-inspired take on the classic silhouette. Keep it simple and wear solo, or add this chunky style to your statement ear stack.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Hinge back</li>\r\n</ul>', 2, NULL, 'BwBpD4', NULL, 10, 1, 0, 1, '2020-12-04 16:49:51', '2020-12-17 18:54:04', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(532, 'BABE LAYERED NECKLACE', 'babe-layered-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>It&#39;s time to celebrate all the ways you are unique! The HS Babe Layered Necklace has two dainty gold plated chains that are layered together, one plain and one with a single round map coin pendant.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'Jg8qxK', NULL, 10, 1, 0, 1, '2020-12-04 16:56:32', '2020-12-17 16:47:29', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(533, 'SHE BELIEVED MINIMALIST BANGLE', 'she-believed-minimalist-bangle', NULL, 0, NULL, NULL, NULL, NULL, '<p>Perfect to wear alone or stacked with other bracelets as part of a wrist stack, this minimalist cuff bracelet is one of those essential pieces that shouldn&rsquo;t be missing from your jewelry box. With the inscription &quot;She believed she could so she did&quot;, this minimalist cuff bracelet looks gorgeous on any wrist. Style it with a minimalist ring and ear cuff for a modern &amp; classy statement.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, 'L4GlsN', NULL, 73, 1, 0, 1, '2020-12-04 17:00:41', '2020-12-17 19:13:29', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(535, 'SARAH BLUE DECOR NECKLACE', 'sarah-blue-decor-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>This necklace can be stacked easily or worn on its own. Its glam gold chain and artsy blue pendant make this necklace a jewelry piece that must not miss from your jewelry collection. Add it to your shopping cart and offer yourself the gift of a beautiful &amp; unique jewelry piece.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 't8kS7y', NULL, 18, 1, 0, 1, '2020-12-05 02:14:59', '2020-12-17 21:17:07', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(536, 'PAMELA CHARM DETAILED BRACELET', 'pamela-charm-detailed-bracelet', NULL, 0, NULL, NULL, NULL, NULL, '<p>This charm bracelets contains several charms arranged beautifully around the chain. Store them in their pouch or box to keep them protected.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, '8ek8zR', NULL, 19, 1, 0, 1, '2020-12-05 02:20:39', '2020-12-17 21:19:01', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(537, 'HEART CHUNKY RING', 'heart-chunky-ring', NULL, 0, NULL, NULL, NULL, NULL, '<p>A classic signet ring with a heart shaped face in shiny gold stainless steel. Rock this cute ring alone or add a personal touch with any of our minimalist rings.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n</ul>', 2, NULL, 'tg6Sjn', NULL, 10, 1, 0, 1, '2020-12-05 02:25:48', '2020-12-17 21:40:04', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,7'),
(538, 'LINK UP CHAIN BRACELET', 'link-up-chain-bracelet', NULL, 0, NULL, NULL, NULL, NULL, '<p>Our designers are obsessed with this new Link up bracelet! It features a unique custom made clasp and a geometric yet elegant chain. Ethically handcrafted and designed to give new meaning to your office essentials, this sleek silver bracelet is a must-have. Turn your workdays into a fashion statement with this charming bracelet.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Clasp</li>\r\n</ul>', 2, NULL, 'zReWwX', NULL, 20, 1, 0, 1, '2020-12-05 02:59:23', '2020-12-17 21:43:27', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,Free Size'),
(539, 'DROP LINK UP NECKLACE', 'drop-link-up-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Why not? A necklace so fine, you&rsquo;ll forget it&rsquo;s even there&mdash;except for everyone asking where it&rsquo;s from. This necklace in shiny gold features a double link chain and a ball dropping charm. Perfect the barely-there look and layer with other dainty chains.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'r72iwg', NULL, 12, 1, 0, 1, '2020-12-05 03:08:27', '2020-12-17 21:45:04', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(540, 'SIMPLE GEMSTONE NECKLACE', 'simple-gemstone-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>The Simple Gold Gemstone Necklace is a minimalist wonder! Shiny stainless steel gold shapes this necklace that has a dainty chain with a gemstone inspired charm, complete with cubic zirconia. You&#39;ll brighten up any day when you&#39;re wearing this cute necklace!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, '2mP8XK', NULL, 20, 1, 0, 1, '2020-12-05 03:13:10', '2020-12-17 21:48:10', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(542, 'LOCK AND KEY DETAILED NECKLACE', 'lock-and-key-detailed-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Exquisite! With a classic link chain, 2 pendants; one with a padlock charm and the other with the complimenting key, this adorable padlock and key necklace is a must-have. Looks fabulous with blouses and dresses with V-necklines.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'QuDPOZ', NULL, 10, 1, 0, 1, '2020-12-05 03:35:40', '2020-12-17 21:55:11', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(543, 'FACE DROP EARRINGS', 'face-drop-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Looking like a classy girl isn&rsquo;t as difficile as it seems. The Human face detailed drop earrings features a tiny chain with a face pendant dangling gorgeously beneath and is the perfect earrings for that classy look you so desire.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'IywD15', NULL, 10, 1, 0, 1, '2020-12-05 03:41:50', '2020-12-17 21:59:43', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(544, 'STUD AND PEARL DROP MISMATCH EARRINGS', 'stud-and-pearl-drop-mismatch-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Hear the buzzing sound? That&rsquo;s your ear lobes begging you to get these extra-stylish drop earrings with a natural pearl dangling charm holding a ring. These drop earrings are guaranteed to become your next jewelry obsession.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, '4Yxux7', NULL, 5, 1, 0, 1, '2020-12-05 03:52:17', '2020-12-17 22:02:33', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,Free Size'),
(545, 'CROSS CRYSTAL GEM NECKLACE', 'cross-crystal-gem-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>It doesn&#39;t get more stylish than the Crystal Gem Gold Classic Cross Necklace. Designed with our new slim plain chain for easy layering, it features a slim cross pendant with a cute simple gem embedded at its centre .Make it your go-to necklace for a chic everyday look</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, '6jkyvW', NULL, 20, 1, 0, 1, '2020-12-05 04:08:01', '2020-12-17 22:04:32', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(546, 'HS MULTIPEARL EARRINGS', 'hs-multipearl-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>The HS Multipearl Ear Jackets are so chic that &quot;luxury&quot; will be your new middle name! A circular clear pearl (in a shiny gold setting) sits at the top of a curved silhouette. Cute, tiered pearls are perfectly aligned on a curved gold bar beneath.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'y4MqUC', NULL, 19, 1, 0, 1, '2020-12-05 04:15:55', '2020-12-11 17:34:55', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,White,Free Size'),
(547, 'RIVA DROP EARRINGS', 'riva-drop-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Don&#39;t wait for the storm to pass! Get outside and feel the beat in the Riva Drop Gold Drop Earrings! Pearl charms, in a circular shape, are framed by shiny gold settings, as they dangle from matching, small gold square shaped hoops.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'kke9gn', NULL, 10, 1, 0, 1, '2020-12-05 06:12:38', '2020-12-16 16:58:59', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,White,Free Size'),
(548, 'PEARLY DROPS EARRINGS', 'pearly-drops-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>These gorgeous earrings with a Pearl link design are elegant, trendy and fun to accessorize. With a polished texture and a unique design, these pearl earrings were created for a fabulous woman. Style them with a collar necklace, a chunky cuff bracelet, gold flat sandals, and an off-white flowy summer dress to create a feminine and beautiful look. Get these trendy earrings and up your jewelry game</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel &amp; Plastic</li>\r\n	<li>Closure: Lever back</li>\r\n</ul>', 2, NULL, 'Rr6Lzp', NULL, 20, 1, 0, 1, '2020-12-05 06:16:21', '2020-12-14 18:08:44', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,White,Free Size'),
(549, 'PADLOCK PENDANT LINK CHAIN NECKLACE', 'padlock-pendant-link-chain-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Amp it up. The Padlock Link chain necklace features an oval link chain with a delicate twist motif, and fastens with a Padlock pendant. It stands out worn solo or layered with our chain necklaces for the ultimate combo.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Pin back</li>\r\n</ul>', 2, NULL, 'ao9fVP', NULL, 20, 1, 0, 1, '2020-12-05 06:20:25', '2020-12-16 14:23:37', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(550, '3 PACK PEARL EAR CUFFS', '3-pack-pearl-ear-cuffs', NULL, 0, NULL, NULL, NULL, NULL, '<p>The easy way to a curated ear, our pearl ear cuffs can be worn with or without ear piercings. Simply put it onto the top of your ear and slide down until it finds a comfortable, secure spot. Perfect worn alone or stacked alongside other studs.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back &amp; Clip on</li>\r\n</ul>', 2, NULL, 'CTZXdF', NULL, 60, 1, 0, 1, '2020-12-05 06:23:23', '2020-12-12 16:41:51', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Gold,Free Size'),
(551, 'SILVER GEM CUFF BANGLES', 'silver-gem-cuff-bangles', NULL, 0, NULL, NULL, NULL, NULL, '<p>All the stars in the sky can&#39;t outshine the HS Gem Cuff Bangles! This brushed cuff bracelet is made on one half with a plain metal and on the other half with a braided metal which hold shiny clear and black zircon gemstones at the center.</p>\r\n\r\n<ul>\r\n	<li>Material: Sterling silver</li>\r\n	<li>Closure: Open</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Material: Sterling silver</li>\r\n	<li>Closure: Open</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 2, NULL, '16N8Si', NULL, 20, 1, 0, 1, '2020-12-05 06:31:27', '2020-12-12 17:38:29', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Sterling Silver,Black,Free Size'),
(552, 'CUTE BEE NECKLACE AND EARRING SET', 'cute-bee-necklace-and-earring-set', NULL, NULL, NULL, NULL, NULL, NULL, '<p>The Cute Bee jewelry set (Necklace + Studs) featuring sustainably-grown stainless steel set in 100% recycled silver is all shades of ideal for that exquisite look. You can wear this stunning set with a blue velvet wrap dress, a pair of suede pumps a chunky silver bangle</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless Steel</li>\r\n	<li>Closure: Earring - Post back, Necklace - Lobster clasp closure</li>\r\n</ul>', 2, NULL, 'WyiBp4', NULL, NULL, 1, 0, 0, '2020-12-05 06:46:30', '2020-12-05 06:46:30', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, ''),
(553, 'PEARL DETAILED BROOCH', 'pearl-detailed-brooch', NULL, 0, NULL, NULL, NULL, NULL, '<p>Add the perfect amount of femme flair to your dresses and shirts with the Pearl detailed brooch! Cute Pearls adorn this absolutely darling brooch in circle-shaped alloy material.</p>\r\n\r\n<ul>\r\n	<li>Material: Alloy</li>\r\n	<li>Closure: Pin closure</li>\r\n</ul>', 2, NULL, 'jfKnVn', NULL, 10, 1, 0, 1, '2020-12-05 06:51:54', '2020-12-11 17:41:03', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Gold,Free Size'),
(554, 'MAPLE LEAF DETAILED BROOCH', 'maple-leaf-detailed-brooch', NULL, 0, NULL, NULL, NULL, NULL, '<p>Add the perfect amount of femme flair to your dresses and shirts with the Maple Leaf brooch! A cute Pearl adorns this absolutely darling brooch at its centre.</p>\r\n\r\n<ul>\r\n	<li>Material: Alloy</li>\r\n	<li>Closure: Pin closure</li>\r\n</ul>', 2, NULL, 'tvXXmv', NULL, 10, 1, 0, 1, '2020-12-05 06:55:10', '2020-12-12 17:48:02', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Gold,Free Size'),
