(556, 'EGYPTIAN BROOCH', 'egyptian-brooch', NULL, 0, NULL, NULL, NULL, NULL, '<p>Add the perfect amount of femme flair to your dresses and shirts with the Ancient Egyptian brooches! This rectangular-shaped brooches will leave you looking all classy and cute.</p>\r\n\r\n<ul>\r\n	<li>Material: Alloy</li>\r\n	<li>Closure: Pin closure</li>\r\n</ul>', 2, NULL, 'fqVTdw', NULL, 10, 1, 0, 1, '2020-12-05 07:04:46', '2020-12-11 17:43:54', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Gold,DESIGN 1'),
(557, 'BEETLE BROOCH AND EARRING SET', 'beetle-brooch-and-earring-set', NULL, 0, NULL, NULL, NULL, NULL, '<p>Add the perfect amount of femme flair to your dresses and shirts with the Beetle brooch set (Brooch + Studs). Suitable for Conferences and ececutive meetings amidst others.</p>\r\n\r\n<ul>\r\n	<li>Material: Alloy</li>\r\n	<li>Closure: Earring- Post back, Brooch- Pin closure<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, '7xtVmL', NULL, 10, 1, 0, 1, '2020-12-05 07:09:25', '2020-12-15 23:29:55', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Multicolor,Free Size'),
(559, 'SWEET PINEAPPLE BROOCH', 'sweet-pineapple-brooch', NULL, 0, NULL, NULL, NULL, NULL, '<p>Add the perfect amount of femme flair to your dresses and shirts with the Pineapple brooch! This brooch is sure to give you a sweet look, as sweet as the fruit. Isn&#39;t that lovely?</p>\r\n\r\n<ul>\r\n	<li>Material: Alloy</li>\r\n	<li>Closure: Pin closure</li>\r\n</ul>', 2, NULL, 'C0JjBg', NULL, 5, 1, 0, 1, '2020-12-05 07:22:45', '2020-12-11 17:46:20', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Green,Free Size'),
(560, 'POPCORN INSPIRED BROOCH', 'popcorn-inspired-brooch', NULL, 0, NULL, NULL, NULL, NULL, '<p>Add the perfect amount of femme flair to your dresses and shirts with the Popcorn Inspired brooch! Cute Pearls adorn this absolutely darling brooches which comes in a variety of colours.Perfect for that movie date you&#39;ve been planning</p>\r\n\r\n<ul>\r\n	<li>Material: Alloy</li>\r\n	<li>Closure: Pin closure</li>\r\n</ul>', 2, NULL, 'rkSABn', NULL, 10, 1, 0, 1, '2020-12-05 07:31:20', '2020-12-11 17:47:12', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Wine,Free Size'),
(561, 'ABBY LOVE INSCRIBED EARRINGS', 'abby-love-inscribed-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Spread love and light this season with the Abby Love Earrings! Brilliant circle shapes this earrings in gold and silver colours, with the Word &quot;Love&quot; inscribed at the centre.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'HGACUJ', NULL, 20, 1, 0, 1, '2020-12-05 07:40:39', '2020-12-11 17:48:58', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(562, 'OLIVIA INTERLOCK EARRINGS', 'olivia-interlock-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Two are better than one - we&#39;re calling it. The Olivia Drop Earrings combine both oval shaped and circle shaped drop rings, interlocked together for double the effect.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'wMgqni', NULL, 19, 1, 0, 1, '2020-12-05 07:48:33', '2020-12-14 18:08:29', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(563, 'CHUNKY C HOOP', 'chunky-c-hoop', NULL, 0, NULL, NULL, NULL, NULL, '<p>The HS C Gold Hoop Earrings Set has everything you need to finish off your look! This set of three chunky, gold hoop earrings have a covetable, minimalist design and a variety of diameters so you&#39;ll always have the perfect pair for any ensemble! And hey sis, you can buy your desired size(s) alone or buy as a set.</p>\r\n\r\n<ul>\r\n	<li>Material: Gold Plated copper</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, '3ueJoz', NULL, 18, 1, 0, 1, '2020-12-05 07:58:27', '2020-12-12 17:41:29', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Gold,Small'),
(564, 'BALL AND PEARL DROP EARRINGS', 'ball-and-pearl-drop-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Polish off your perfectly chic look with the Ball and Pearl drop Earrings! Shiny rosegold ball charm hangs from dainty metal and a pearl charm dangles beneath long flexible wires attached to the hooks which hang at back</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'nD91qr', NULL, 19, 1, 0, 1, '2020-12-05 08:04:42', '2020-12-14 18:06:34', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(565, 'GEM PENTA DROP EARRINGS', 'gem-penta-drop-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>The HS Gem Penta Drop Earrings are the latest craze we can&#39;t get enough of! Dainty green flowery patterned charms support long dangling chains with gems attached to their tips that dust the neck.</p>\r\n\r\n<p>Material: Stainless steel<br />\r\nClosure: Post back</p>', 2, NULL, 'kOKdMP', NULL, 20, 1, 0, 1, '2020-12-05 08:11:44', '2020-12-14 18:08:07', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(566, 'FLORAL DETAILED CHAIN BRACELET', 'floral-detailed-chain-bracelet', NULL, 0, NULL, NULL, NULL, NULL, '<p>Sometimes you just need to add a little bit of detail to your look and that&#39;s where the Floral Detailed Chain Bracelet comes in! Shiny rosegold/silver shapes this beautiful bracelet that features a simple chain with a flower design affixed at its center.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'JpkTMi', NULL, 10, 1, 0, 1, '2020-12-05 09:27:21', '2020-12-11 17:52:58', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(567, 'HEART PULSE ANKLET', 'heart-pulse-anklet', NULL, 0, NULL, NULL, NULL, NULL, '<p>This delicate rosegold anklet with a pulse and heart detail is life-resistant, chic and great to wear both with sandals and sneakers, this anklet is a must-have jewelry piece for any stylish woman.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'KspAoV', NULL, 20, 1, 0, 1, '2020-12-05 09:37:59', '2020-12-12 19:38:35', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(568, 'CHUNKY SMILEY AND LAYERED NECKLACE', 'chunky-smiley-and-layered-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>The perfect balance of bold and dainty: our chunky smiley and plain layered Necklace are a perfect power duo. This layering set can be easily styled from day to night.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'AU3nkj', NULL, 10, 1, 0, 1, '2020-12-05 09:42:51', '2020-12-16 15:25:12', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(569, 'PADLOCK CHARM AND SMILEY CHAIN BRACELET', 'padlock-charm-and-smiley-chain-bracelet', NULL, 0, NULL, NULL, NULL, NULL, '<p>This gorgeous bracelet set features a simple chain and a link chain with a shiny padlock charm and a smiley face charm, both dangling from the link chain. Get a feminine and stunning look by wearing this bracelet along with a pair of studs, a flowy midi dress, and a solitaire minimalist ring. Get this bracelet set and enjoy the feeling of wearing a unique jewelry piece.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;</p>', 2, NULL, 'zAWR1z', NULL, 10, 1, 0, 1, '2020-12-05 09:49:30', '2020-12-11 17:57:52', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(571, 'VARIANT CHARMS CHAIN BRACELET', 'variant-charms-chain-bracelet', NULL, 0, NULL, NULL, NULL, NULL, '<p>Add the perfect amount of femme glam to your look with the Variant Charms Bracelet! Shiny chain shapes this absolutely darling bracelet that&#39;s accented with beautiful charms in different shapes and sizes.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'TPmnN7', NULL, 15, 1, 0, 1, '2020-12-05 10:02:45', '2020-12-12 19:00:07', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(572, 'INTERLOCK RINGS AND PADLOCK CHARM ANKLET', 'interlock-rings-and-padlock-charm-anklet', NULL, 0, NULL, NULL, NULL, NULL, '<p>HS Exclusive! You&#39;ll love the delicate charm of the Interlock Rings and Padlock Charm Anklet! Single layer of dainty chain, accented with a padlock and 2 interlocking circle charms shape this simply stunning ankle bracelet.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'FGHkWo', NULL, 10, 1, 0, 1, '2020-12-05 10:09:06', '2020-12-12 18:59:21', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(573, 'LISA TWO FACED CHUNKY CHOKER NECKLACE', 'lisa-two-faced-chunky-choker-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Make a bold fashion statement everywhere you go in the Lisa Chunky Chain Choker Necklace! This trendy choker necklace , available in silver and rosegold colours is made from a sleek and chunky chain with a circular black coloured bar charm. On the flipside, it shows a silver coloured bar charm.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'YeRXrV', NULL, 5, 1, 0, 1, '2020-12-05 10:15:21', '2020-12-11 18:01:58', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(574, 'RN DROP EARRINGS', 'rn-drop-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>These mini hoops feature a circle shaped Black coloured bar charm, surrounded by the numbers 1-12 in Roman Numerals, suspended from a shiny rosegold hoop. This is a must have pair of earrings!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'qtygr2', NULL, 10, 1, 0, 1, '2020-12-05 10:19:45', '2020-12-14 18:06:13', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(575, 'KISS, GEM AND BALL CHARM ANKLET', 'kiss-gem-and-ball-charm-anklet', NULL, 0, NULL, NULL, NULL, NULL, '<p>If you dote over the dainty, you&#39;re going to adore the HS Kiss, Gem and Ball Charm gold Anklet! This stainless steel anklet features a simple chain construction with dangling ball charms in big and small sizes. Wear her with heels or sneakers, you&#39;ll look sweet either way!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'Fr6fOH', NULL, 10, 1, 0, 1, '2020-12-05 10:23:50', '2020-12-12 19:37:56', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(576, 'KNOT CUFF BANGLE', 'knot-cuff-bangle', NULL, 0, NULL, NULL, NULL, NULL, '<p>You&#39;ll be so in love with the HS Knot Cuff Bracelet, you might just want to elope! A shiny band is twisted into an adorable knot that perches atop your wrist. This beauty comes in rosegold and silver colours, we know you love to have options.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, '4wmUt7', NULL, 10, 1, 0, 1, '2020-12-05 10:31:14', '2020-12-11 18:04:17', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(577, 'SAFFY MINI HOOPS', 'saffy-mini-hoops', NULL, 0, NULL, NULL, NULL, NULL, '<p>Make sure to circle back around and check out the HS Saffy Mini Hoop Earrings! These chunky small hoop earrings are a perfect everyday accessory for everything from jeans and tees to LBDs!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Hinged back</li>\r\n</ul>', 2, NULL, 'LTMP1w', NULL, 10, 1, 0, 1, '2020-12-05 10:35:35', '2020-12-11 18:07:13', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
(578, 'KFG RING', 'kfg-ring', NULL, 0, NULL, NULL, NULL, NULL, '<p>Add a touch of glamour to your smart outfit with this free sized silver ring with the Inscription &quot;Keep Fucking Going&quot;. With an inlaid glossy silver band, a sleek swirl design and a polished feel, this ring will definitely inspire you to keep pushing and not to quit. Pair it with a delicate French manicure to create a clean, premium look.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, 'QvR73r', NULL, 10, 1, 0, 1, '2020-12-05 10:42:30', '2020-12-11 18:08:06', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,Free Size'),
(579, 'KNOT CHAIN BRACELET', 'knot-chain-bracelet', NULL, 0, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'cKozik', NULL, 7, 1, 0, 1, '2020-12-05 10:46:17', '2020-12-14 15:10:19', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,Free Size'),
