(602, 'HANNAH MARTIN EMPTY GIFT BOX', 'hannah-martin-empty-gift-box', NULL, 0, NULL, NULL, NULL, NULL, '<p>A gift is not a gift without a giftbox. Designed to keep your watches in the finest condition, this giftbox will cherish and protect your gift so you can give your absolute best to the one you love. Add a Hannah Martin watch and bracelet of your choice before checking out</p>\r\n\r\n<ul>\r\n	<li>Comes with a paper bag, warranty card and a watch screwdriver. Add your prefered Hannah martin bangle and watch to cart</li>\r\n</ul>', 2, NULL, '3edrlI', NULL, 75, 1, 0, 1, '2020-12-08 18:19:34', '2020-12-12 01:31:34', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Black,ONE SIZE'),
(603, 'MINI FOCUS OCTA BLUE FACE LEATHER WATCH', 'mini-focus-octa-blue-face-leather-watch', NULL, 0, NULL, NULL, NULL, NULL, '<p>Welcome to th Mini Focus Women Quartz Octagon Case Fashion Watches with Crystal Diamonds Leather Strap 3ATM Waterproof Female Wristbands for Business &amp; Daily Life (Box Packaged)This is a fashion and elegant watch designed for women. Well made with leather strap, quartz movement and exquisite dial. Well packaged, good gift idea!</p>\r\n\r\n<ul>\r\n	<li>Case Material: Alloy</li>\r\n	<li>Movement Type: Quartz Movement</li>\r\n	<li>Clasp Type: Pin Solid steel Buckle</li>\r\n	<li>Glass Material: Hardened Mineral Glass</li>\r\n	<li>Surface Diameter: 20mm</li>\r\n	<li>Weight: 50g</li>\r\n	<li>Thickness: 7.9mm</li>\r\n	<li>Waterproof: 3ATM</li>\r\n</ul>', 2, NULL, 'y4o8sQ', NULL, 8, 1, 0, 1, '2020-12-08 18:50:11', '2020-12-11 21:04:15', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'LEATHER,Black,ONE SIZE'),
(604, 'MINI FOCUS OCTA FACE MESH WATCH', 'mini-focus-octa-face-mesh-watch', NULL, 0, NULL, NULL, NULL, NULL, '<p>Welcome to the Mini Focus Women Quartz Octagon Case Fashion Watch with Crystal Diamonds Steel Mesh Strap 3ATM Waterproof Female Wristbands for Business &amp; Daily Life (Box Packaged)This is a fashion and elegant watch designed for women. Well made with steel mesh belt, quartz movement and exquisite dial. Well packaged, good gift idea!</p>\r\n\r\n<ul>\r\n	<li>Case Material: Alloy</li>\r\n	<li>Movement Type: Quartz Movement</li>\r\n	<li>Clasp Type: Solid steel Buckle</li>\r\n	<li>Glass Material: Mineral Glass</li>\r\n	<li>Surface Diameter: 20mm</li>\r\n	<li>Weight: 60g</li>\r\n	<li>Thickness: 7.9mm</li>\r\n	<li>Waterproof: 3ATM</li>\r\n</ul>', 2, NULL, 'OQf0zq', NULL, 2, 1, 0, 1, '2020-12-08 19:10:17', '2020-12-17 15:15:45', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'MESH,Black,ONE SIZE'),
(605, 'HANNAH MARTIN BOLD COUNTS MESH WATCH', 'hannah-martin-bold-counts-mesh-watch', NULL, 0, NULL, NULL, NULL, NULL, '<p>The Hannah Martin Bold Counts Mesh Watch takes its design inspiration from the clean lines and muted palettes of minimalist architecture. Featuring a slim 32mm case, concave face and modular strap, this model is the essence of raw, refined simplicity.<br />\r\nWear it alone or pair with the Matching Hannah Martin Bangle for a perfect combo</p>\r\n\r\n<ul>\r\n	<li>Case Material: Alloy</li>\r\n	<li>Movement Type: Quartz Movement</li>\r\n	<li>Clasp Type: Solid Steel Clasp</li>\r\n	<li>Glass Material: Coated Mineral Glass</li>\r\n	<li>Surface Diameter: 34mm</li>\r\n	<li>Weight: 60g</li>\r\n	<li>Thickness: 8mm</li>\r\n	<li>Waterproof: 3ATM</li>\r\n</ul>', 2, NULL, 'i9jEpr', NULL, 2, 1, 0, 1, '2020-12-08 19:42:49', '2020-12-12 18:36:53', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'MESH,Rosegold,ONE SIZE'),
(606, 'HANNAH MARTIN BANGLE', 'hannah-martin-bangle', NULL, 0, NULL, NULL, NULL, NULL, '<p>Perfect to wear alone or stacked with other bracelets as part of a wrist stack, this cuff bracelet is one of those essential pieces that shouldn&rsquo;t be missing from your jewellry collection. Wear alone or pair it with any of the Hannah Martin watches from our collection for a perfect elegance</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, 'qT2IEY', NULL, 25, 1, 0, 1, '2020-12-08 19:55:25', '2020-12-16 16:53:11', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,ONE SIZE'),
(607, 'JADE FACIAL ROLLER & GUA SHA TOOL', 'jade-facial-roller-gua-sha-tool', NULL, 0, NULL, NULL, NULL, NULL, '<p>Jade Facial Roller &amp; Gua Sha Tool are skincare tools set designed to promote inner calm and outer beauty. Rolling the applicator across the face helps invigorate the lymphatic system, which promotes detoxification. This type of massage can help reduce signs of puffiness, wrinkles and facial tension to leave skin looking and feeling more youthful.</p>\r\n\r\n<ul>\r\n	<li>Material: 100% Original &amp; Premium quality jade stone</li>\r\n	<li>Rejuvenate skin and health without any chemicals or irritants.</li>\r\n	<li>Use the best jade roller massager with face cream can help the cream to be absorbed too.</li>\r\n	<li>One rose quartz jade roller and one gua sha scraping are included in the gift box</li>\r\n</ul>', 2, NULL, '9JMYGY', NULL, 10, 1, 0, 1, '2020-12-08 20:41:01', '2020-12-11 21:37:50', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Pink'),
(608, 'ACRYLIC JEWELLRY ORGANIZER', 'acrylic-jewellry-organizer', NULL, 0, NULL, NULL, NULL, NULL, '<p>This transparent cylinder-shaped organizer with four deep sections hold all types of jewellry ranging from wristwatches, bracelets, rings earrings and so on. It enables you see all your jewellry at a single glance. Cute! Isn&#39;t it?</p>\r\n\r\n<ul>\r\n	<li>Material: Plastic</li>\r\n	<li>360&deg; rotation</li>\r\n	<li>Dimension: Length: 17.5cm, Diameter: 11.5cm</li>\r\n	<li>Weight: 0.4kg</li>\r\n	<li>Water resistant</li>\r\n</ul>', 2, NULL, '4nukyv', NULL, 50, 1, 0, 1, '2020-12-08 21:06:39', '2020-12-11 21:38:35', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'White'),
(609, 'BLACK LARGE CAPACITY JEWELLRY BOX', 'black-large-capacity-jewellry-box', NULL, 0, NULL, NULL, NULL, NULL, '<p>Getting organised this Season? This large capacity jewellery box available in 3 colours features three separate compartments - with hooks for necklaces - with elasticated pockets, plus holders for rings, bracelets, wristwatches and earrings. It&#39;s finished with a lidded compartment for extra security and a mirror to check out your glam.</p>\r\n\r\n<ul>\r\n	<li>Material: Faux leather</li>\r\n	<li>Dimension: L 17cm, H 9cm, W 23cm</li>\r\n	<li>Water Resistant</li>\r\n</ul>', 2, NULL, '9qJgKr', NULL, 10, 1, 0, 1, '2020-12-08 21:13:59', '2020-12-17 14:34:44', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Black,Red'),
(610, 'PARTITIONED ORGANIZER WITH MIRROR', 'partitioned-organizer-with-mirror', NULL, 0, NULL, NULL, NULL, NULL, '<p>An elasticated pouch and two deep sections hold bracelets, while a padded compartment keeps earrings and rings safe on the move. Hooks for necklaces are also not left out. Topped off with an even tone zipper, all you have to decide is where you&#39;re going.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Material: Faux leather</li>\r\n	<li>Dimension: L 11cm, H 5cm, W 16cm</li>\r\n	<li>Water Resistant</li>\r\n</ul>\r\n\r\n<p><br />\r\n&nbsp;</p>', 2, NULL, 'ywCxuZ', NULL, 15, 1, 0, 1, '2020-12-08 21:23:37', '2020-12-11 21:45:18', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Black,White'),
(611, 'DOUBLE LAYERED CLIP DETAILED ORGANIZER', 'double-layered-clip-detailed-organizer', NULL, 0, NULL, NULL, NULL, NULL, '<p>Our layered jewelry case features two separate compartments - with hooks for necklaces, elasticated pockets and holders for rings, bracelets and stud earrings. It&#39;s finished with a lidded compartment with a clip hook closure for extra security and &quot;portability&quot;.</p>\r\n\r\n<ul>\r\n	<li>Material: Faux leather</li>\r\n	<li>Dimension: L 11cm, H 5cm, W 16cm</li>\r\n	<li>Water resistant</li>\r\n</ul>', 2, NULL, 'HnIwxA', NULL, 5, 1, 0, 1, '2020-12-09 15:15:14', '2020-12-11 21:44:09', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Pink,Blue'),
(612, 'STAR AND AZTEC LAYERED NECKLACE', 'star-and-aztec-layered-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Complement a strapless maxi dress with the Star &amp; Aztec Layered Necklace! A duo of shiny gold chains, punctuated with star pendant necklace layer together beautifully large round aztec pendant.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'iIYOWZ', NULL, 10, 1, 0, 1, '2020-12-09 18:50:20', '2020-12-16 15:20:32', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,ONE SIZE'),
(613, 'FREDA GEM STUD LIME GREEN STUD', 'freda-gem-stud-lime-green-stud', NULL, 0, NULL, NULL, NULL, NULL, '<p>A new ear stack essential. The HS Gem stud earrings comes in a single Opalite stone with several exciting colours embedded in Silver and gold copper. Style them with your favorite mini hoops or let them shine on their own.</p>\r\n\r\n<ul>\r\n	<li>Material: Copper</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'HfvmFK', NULL, 3, 1, 0, 1, '2020-12-09 21:41:30', '2020-12-16 14:40:56', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Silver,6MM'),
(614, 'CLARA CHUNKY MINI HOOPS', 'clara-chunky-mini-hoops', NULL, 0, NULL, NULL, NULL, NULL, '<p>Giving a nostalgic nod to the 80s, the Clara Chunky Ridge Hoops are a standout piece from the collection. With a graduate ridge detail that adds depth and dimension, these hoops are as striking during the day as with an LBD at night.</p>\r\n\r\n<ul>\r\n	<li>Material: Plated Copper</li>\r\n	<li>Closure: Hinged back</li>\r\n</ul>', 2, NULL, 'y5vj2B', NULL, 5, 1, 0, 1, '2020-12-09 21:47:40', '2020-12-16 21:57:18', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Gold,Free Size'),
(615, 'PADLOCK DETAILED NECKLACE', 'padlock-detailed-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>You&#39;ll cherish the Padlock detailed Gold Pendant Necklace! Gold chain holds a padlock detailed pendant with a simple chain style. Create a vintage vibe by adding this elegant necklace to your ensemble!<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'njuHwE', NULL, 10, 1, 0, 1, '2020-12-09 23:40:29', '2020-12-16 14:21:50', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
(616, 'BUTTERFLY EARRINGS', 'butterfly-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Power up your earring game with this butterfly earrings featuring shiny glitters; perfect for cocktail parties and office days as well,Offer yourself a bold present and make sure to get this gorgeous earrings before it&rsquo;s out of stock.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Post back</li>\r\n</ul>', 2, NULL, 'q7Daa8', NULL, 4, 1, 0, 1, '2020-12-09 23:47:10', '2020-12-17 07:18:07', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Gold,Free Size'),
