(656, 'BIRD & PEARL BROOCH', 'bird-pearl-brooch', NULL, 0, NULL, NULL, NULL, NULL, '<p>Add the perfect amount of femme flair to your dresses and shirts with the Bird and Pearl brooch! Featuring a cute Pearl charm dangling off the beak of the bird.</p>\r\n\r\n<ul>\r\n	<li>Material: Alloy</li>\r\n	<li>Closure: Pin closure</li>\r\n</ul>', 2, NULL, 'KVgqSM', NULL, 10, 1, 0, 1, '2020-12-10 15:02:02', '2020-12-12 16:50:00', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Multicolor,ONE SIZE'),
