(663, 'ZODIAC SIGN BRACELETS', 'zodiac-sign-bracelets', NULL, 0, NULL, NULL, NULL, NULL, '<p>We took a peek at your weekly horoscope, and it suggested you and the HS Zodaic Bracelet are meant to be together! This Rosegold Stainless steel chain bracelet has the Zodiac symbol charm in the center to show some love for all the Energetic babes out there!</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'TrJj88', NULL, 2, 1, 0, 1, '2020-12-11 00:59:18', '2020-12-12 17:21:57', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Rosegold,VIRGO,Rosegold,ARIES'),
