(688, 'ELENA HIGH HEELED MULES', 'elena-high-heeled-mules', NULL, 0, NULL, NULL, NULL, NULL, '<p>Super sleek, subtly sexy, and so cute are just some of the ways we&#39;d describe the Elena High Heeled Mules! These faux leather mules have a square toe bed, a peep toe, and a wide toe strap. Slightly flared sole sits above a sturdy pencil heel and a slide-on design.</p>\r\n\r\n<ul>\r\n	<li>PU Leather</li>\r\n	<li>Cushioned Insole</li>\r\n	<li>3.5 inches heel<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'giW9KL', NULL, 1, 1, 1, 1, '2020-12-12 15:57:35', '2020-12-17 22:11:46', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Heeled Mules,Mid Heel,Outing,Burgundy,36'),
