(708, 'GEO CUFF BRACELET SET', 'geo-cuff-bracelet-set', 6750, 0, NULL, NULL, NULL, NULL, '<p>This set features our&nbsp;Geo Square, Geo Triangle &amp; Geo Ball cuff bangle. Gold metal shapes an open cuff silhouette with large and small geometric shapes at the ends, both giving a chic glam to the wrist.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, 'fOw0FL', NULL, 2, 1, 1, 0, '2020-12-13 18:08:14', '2020-12-15 20:31:39', NULL, 0, NULL, NULL, 'https://hautesignatures.com/images/products/LaqtJuGuSHoDZBMdNuUmdUmK6zQKxTFljqzdvtqf.jpeg', NULL, NULL, 'simple', 0, 'Stainless steel'),
(709, 'GEM CUFF BANGLE GIFT SET', 'gem-cuff-bangle-gift-set', 7000, 0, NULL, NULL, NULL, NULL, '<p>All the stars in the sky can&#39;t outshine the HS Gem Cuff Bangles! This brushed cuff bracelet is made on one half with a plain metal and on the other half with a braided metal which hold shiny clear and black zircon gemstones at the center, both giving a chic glam to the wrist.</p>\r\n\r\n<ul>\r\n	<li>Material: Sterling silver</li>\r\n	<li>Closure: Open</li>\r\n</ul>', 2, NULL, 'eoacLR', NULL, 2, 1, 1, 0, '2020-12-13 18:16:28', '2020-12-15 20:34:05', NULL, 0, NULL, NULL, 'https://hautesignatures.com/images/products/8BwIU5W923UCFPscTkD1GnbqXkoHuvErqmZMGy73.jpeg', NULL, NULL, 'simple', 0, 'Sterling Silver'),
(710, 'CHUNKY C HOOP SET', 'chunky-c-hoop-set', 6000, 0, NULL, NULL, NULL, NULL, '<p>The&nbsp;Chunky C hoop set&nbsp;Earrings Set has everything you need to finish off your look! This set of three chunky, gold hoop earrings have a covetable, minimalist design and a variety of diameters so you&#39;ll always have the perfect pair for any ensemble!</p>\r\n\r\n<ul>\r\n	<li>Material: Copper</li>\r\n	<li>Closure: Post Back</li>\r\n</ul>', 2, NULL, 'rlgvEU', NULL, 2, 1, 1, 0, '2020-12-13 18:27:36', '2020-12-15 20:33:05', NULL, 0, NULL, NULL, 'https://hautesignatures.com/images/products/JZlpKmr98H04qmUm6y7LMA4fQ6TQ3RrCnFymkry3.jpeg', NULL, NULL, 'simple', 0, 'Plated Copper/Alloy'),
(711, 'ROSE AND BEE MALACHITE FACE LEATHER STRAP WATCH', 'rose-and-bee-malachite-face-leather-strap-watch', NULL, NULL, NULL, NULL, NULL, NULL, '<p>Show off in style with the Rose and Bee Leather Square Face Watch with an adjustable Strap. This watch comes in a green coloured dial and screams all languages of gorgeousness</p>\r\n\r\n<ul>\r\n	<li>Case Material: Alloy</li>\r\n	<li>Movement Type: Quartz Movement</li>\r\n	<li>Clasp Type: Solid Steel Buckle</li>\r\n	<li>Watch band material: Leather</li>\r\n	<li>Glass Material: Coated Mineral Glass</li>\r\n	<li>Surface Diameter: 27mm</li>\r\n	<li>Weight: 50g</li>\r\n	<li>Thickness: 7mm</li>\r\n	<li>Waterproof: 3ATM</li>\r\n</ul>\r\n\r\n<p><br />\r\n<br />\r\n&nbsp;</p>', 2, NULL, 'kNpWqR', NULL, NULL, 1, 0, 1, '2020-12-13 19:53:54', '2020-12-13 19:53:54', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'LEATHER,Black,ONE SIZE'),
(712, 'DOUBLE POCKETS LONG SLEEVE BUTTON-UP SHIRT', 'double-pockets-long-sleeve-button-up-shirt', NULL, 0, NULL, NULL, NULL, NULL, '<p>We love a timeless classic, so the Double Pockets Long Sleeve Button-Up Shirt is giving us some serious heart eyes! This chic collared top has two front patch pockets and a full covered button placket running the length of its lightweight, polyester bodice. Long sleeves fasten with buttoning cuffs.<br />\r\nSee size guide below for more information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Material: Polyester</p>\r\n\r\n<p>SIZE UK 6/8&nbsp;Shoulder 41cm, Sleeve 54cm, Chest 110cm, Hem 110, Length 72cm</p>\r\n\r\n<p>SIZE UK 10&nbsp;Shoulder 43cm, Sleeve 55cm, Chest 114cm, Hem 114cm, Length 73cm</p>\r\n\r\n<p>Model wears UK size 6<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 2, NULL, 'M9DQ5R', NULL, 4, 1, 1, 1, '2020-12-13 21:31:34', '2020-12-17 14:46:10', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Grey,UK SIZE 6/8'),
(713, 'FAE FAUX SILK SHIRT', 'fae-faux-silk-shirt', NULL, 0, NULL, NULL, NULL, NULL, '<p>No doubts about it, the Fae Faux Silk Shirt is seriously chic! This Faux silk top features a subtle collared neckline and sleeves with buttoning cuffs, and a false button placket down the blousy bodice.<br />\r\nSee size guide below for more information.</p>\r\n\r\n<p>Material: Polyester</p>\r\n\r\n<p>UK 6/8&nbsp;Shoulder 36cm, Sleeve 60cm, Bust 86cm, Length 67cm</p>\r\n\r\n<p>UK 10&nbsp;Shoulder 38cm, Sleeve 63cm,&nbsp;Bust 92cm, Length 70cm</p>\r\n\r\n<p>UK 12&nbsp;Shoulder cm, Sleeve 63cm, Bust 96cm, Length 70cm</p>\r\n\r\n<p>Model wears UK size 6</p>\r\n\r\n<p>(Sleeves may be short for tall shoppers)</p>', 2, NULL, 'guBts1', NULL, 1, 1, 1, 1, '2020-12-14 08:10:49', '2020-12-17 16:44:28', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Grey,UK SIZE 6/8'),
(714, 'HS CHIC LONG SLEEVED SHIRT', 'hs-chic-long-sleeved-shirt', NULL, 0, NULL, NULL, NULL, NULL, '<p>Styling endless looks is even easier now that we&#39;ve got the HS Chic Long Sleeved shirt! This lightweight cotton&nbsp;top has a collared neckline, long sleeves, front patch pocket, and a functional button placket at front. The oversized bodice has that laid-back look we love -- and looks amazing half-tucked into high rise jeans!<br />\r\nSee size guide below for more information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Material: Cotton</p>\r\n\r\n<p>UK 8&nbsp;Shoulder 40cm,&nbsp;Sleeve 66cm, Bust 88cm, Length 70cm</p>\r\n\r\n<p>UK 10&nbsp;Shoulder 40cm,&nbsp;Sleeve cm, Bust 92cm, Length 70cm</p>\r\n\r\n<p>Model wears UK size 6<br />\r\n&nbsp;</p>', 2, NULL, 'RJaF1f', NULL, 4, 1, 1, 1, '2020-12-14 08:21:48', '2020-12-17 15:10:45', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Mustard,UK SIZE 6/8'),
(715, 'ARIANA ASSYMETRIC SIDE DETAILED BLOUSE', 'ariana-assymetric-side-detailed-blouse', NULL, 0, NULL, NULL, NULL, NULL, '<p>Fall in love every time you pair anything in your closet with the Ariana Side Detailed Blouse! Cotton knit fabric shapes a round neckline, a princess-seamed bodice, and short sleeves with a rounded hem.<br />\r\nSee size guide below for more information.</p>\r\n\r\n<p>Material: Cotton ONE SIZE FITS UK 6-10</p>\r\n\r\n<p>Shoulder 46cm, Sleeve 27cm, Bust 96cm, Length 65cm</p>\r\n\r\n<p>Model wears UK size 6<br />\r\n&nbsp;</p>', 2, NULL, 'YdFh8y', NULL, 9, 1, 1, 1, '2020-12-14 08:31:12', '2020-12-17 15:20:22', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Black,UK 6-10'),
(716, 'POCKET DETAILED T SHIRT', 'pocket-detailed-t-shirt', NULL, 0, NULL, NULL, NULL, NULL, '<p>Not only will the Pocket Detailed Tee put a smile on your face, it&#39;ll also show off your fabulous style sense! The crewneck, short sleeves, and patch pocket keep the classic tee look on this top, but the jersey knit fabric has a burnout texture keeping it fresh and unique. Rounded hem brings the final touch.<br />\r\nSee size guide below for more information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Material: Polyester</p>\r\n\r\n<p>ONE SIZE FITS UK 6-10</p>\r\n\r\n<p>48, 19, 92, 60 Shoulder 48cm, Sleeve 19cm, Bust cm, Length 92cm</p>\r\n\r\n<p>Model wears UK size 6<br />\r\n&nbsp;</p>', 2, NULL, 'uI8j6L', NULL, 19, 1, 1, 1, '2020-12-14 08:35:42', '2020-12-17 15:31:19', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Purple,UK 6-10'),
(717, 'MELISSA LOUNGE WEAR', 'melissa-lounge-wear', NULL, 0, NULL, NULL, NULL, NULL, '<p>Whether you&#39;re binge-watching, errand running, or chilling on your dream vacation, the Melissa Lounge Wear set is a perfect pick! Comfy Polyester creates this slouchy fitted tee with a rounded crew neckline, long sleeves, and a &quot;MAKE TODAY AMAZING&quot; slogan. Pair with the matching pants for a complete look!<br />\r\nSee size guide below for more information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Material: Cotton</p>\r\n\r\n<p>UK 6&nbsp;Sleeve 60cm, Bust 94cm, Waist 60cm-84cm, Hips 88cm, Trouser Length 89cm</p>\r\n\r\n<p>UK 8&nbsp;Sleeve 61cm, Bust 98cm, Waist 62cm-88cm, Hips 90cm, Trouser Length 89cm</p>\r\n\r\n<p>UK 10&nbsp;Sleeve 64cm, Bust 106cm, Waist 62cm-92cm, Hips 100cm, Trouser Length 91cm</p>\r\n\r\n<p>UK 12&nbsp;Sleeve 65cm, Bust 110cm, Waist 62cm-100cm, Hips 100cm, Trouser Length 94cm</p>\r\n\r\n<p>Model wears UK size 6<br />\r\n&nbsp;</p>', 2, NULL, 'AQddfv', NULL, 2, 1, 1, 1, '2020-12-14 08:43:00', '2020-12-17 15:34:02', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Green,UK SIZE 6/8'),
(718, 'BEYBEY PJ SET', 'beybey-pj-set', NULL, 0, NULL, NULL, NULL, NULL, '<p>Whether you&#39;re weekend chilling or jetting off somewhere exciting, you&#39;ll want to live in the Beybey Lounge wear! This soft cotton&nbsp;has a button down shirt, a slightly slouchy and relaxed bodice, and short sleeves coupled with an elasticized banded waist shorts.<br />\r\nSee size guide below for more information.</p>\r\n\r\n<p>Material: Cotton</p>\r\n\r\n<p>UK 6&nbsp;Sleeve 60cm, Bust 94cm, Waist 60cm-84cm, Hips 88cm, Trouser Length 89cm</p>\r\n\r\n<p>UK 8&nbsp;Sleeve 61cm, Bust 98cm, Waist 62cm-88cm, Hips 90cm, Trouser Length 89cm</p>\r\n\r\n<p>UK 10&nbsp;Sleeve 64cm, Bust 106cm, Waist 62cm-92cm, Hips 100cm, Trouser Length 91cm</p>\r\n\r\n<p>UK 12&nbsp;Sleeve 65cm, Bust 110cm, Waist 62cm-100cm, Hips 100cm, Trouser Length 94cm</p>\r\n\r\n<p>Model wears UK size 6</p>', 2, NULL, '9UQ6sz', NULL, 4, 1, 1, 1, '2020-12-14 08:46:42', '2020-12-17 15:36:28', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Grey,UK SIZE 6/8'),
(719, 'SERA TEDDY DETAILED NIGHT DRESS', 'sera-teddy-detailed-night-dress', NULL, 0, NULL, NULL, NULL, NULL, '<p>Even when you lay your head to rest, the Sera Teddy Bear Detailed Nightwear will keep you stylish beyond belief! Soft and lightweight polyester, in trendy pink and white colours shape these cute nightwears withn teddy bear prints.<br />\r\nSee size guide below for more information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Material: Cotton</p>\r\n\r\n<p>ONE SIZE FITS</p>\r\n\r\n<p>UK 6-12 Shoulder 40cm, Sleeve 18cm, Bust 84cm, Length 92cm</p>\r\n\r\n<p>Model wears UK size 6<br />\r\n&nbsp;</p>', 2, NULL, 'T7qgtK', NULL, 4, 1, 1, 1, '2020-12-14 09:03:19', '2020-12-17 15:39:46', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Pink,UK SIZE 6-12'),
(720, 'VICKY V-NECK LOUNGE WEAR', 'vicky-v-neck-lounge-wear', NULL, 0, NULL, NULL, NULL, NULL, '<p>Lounge the day away in the comfort of the Vicky V neck Lounge Wear! Comfy cotton shapes this lounge wear that features a round neck top and an elasticized waisted loose fitted shorts. Rock it with a simple pair of slides for uniqueness<br />\r\nSee size guide below or more information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Material: Cotton</p>\r\n\r\n<p>ONE SIZE FITS UK 8-16</p>\r\n\r\n<p>Shoulder 45cm, Bust 106cm, Top Length 66cm, Waist 60-78cm, Hips 102cm, Pant Length 34cm</p>\r\n\r\n<p>Model wears UK size 6<br />\r\n&nbsp;</p>', 2, NULL, 'Ae6DEC', NULL, 5, 1, 1, 1, '2020-12-14 09:10:04', '2020-12-17 15:43:27', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Black,UK SIZE 8-16'),
(721, 'VICKY BUTTON DOWN LOUNGE WEAR', 'vicky-button-down-lounge-wear', NULL, 0, NULL, NULL, NULL, NULL, '<p>Lounge the day away in the comfort of the Vicky Button Down Lounge Wear! Comfy cotton&nbsp;shapes this lounge wear that features a fancy button down detailed top and an elasticized waisted loose fitted shorts, complete with diagonal front pockets. Rock it with a simple pair of slides for uniqueness.<br />\r\nSee size guide below or more information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Material: Cotton</p>\r\n\r\n<p>ONE SIZE FITS UK 8-16</p>\r\n\r\n<p>Shoulder 45cm, Bust 106cm, Top Length 66cm, Waist 60-78cm, Hips 102cm, Pant Length 34cm</p>\r\n\r\n<p>Model wears UK size 6<br />\r\n&nbsp;</p>', 2, NULL, 'RDLeaF', NULL, 5, 1, 1, 1, '2020-12-14 09:19:43', '2020-12-17 15:42:45', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Nude,UK SIZE 8-16'),
(722, 'SAMIRA LOUNGE WEAR', 'samira-lounge-wear', NULL, 0, NULL, NULL, NULL, NULL, '<p>Ideal for lazy days and staying in, the Samira Lounge Wear is gonna be your new cozy go-to! Soft and stretchy polyester fabric forms this easy one-piece with a rounded neckline with cute trim details and short sleeves with cute trim details at the cuffs. Attached shorts fall below the elasticized waist and have a very comfy feel.<br />\r\nSee size guide below for more information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Material: Cotton</p>\r\n\r\n<p>UK 6-10 Sleeves 39cm, Bust 116cm, Top Length 57cm, Waist 58-110cm, Hips 102cm, Pant Length 36cm</p>\r\n\r\n<p>UK&nbsp;12-16 Sleeves 40cm, Bust 120cm, Top Length 58cm, Waist 60-112cm, Hips 102cm, Pant Length 38cm</p>\r\n\r\n<p>Model wears UK size 6<br />\r\n&nbsp;</p>', 2, NULL, 'JLEZfJ', NULL, 1, 1, 0, 0, '2020-12-14 09:24:07', '2020-12-17 15:46:32', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Navy Blue,UK 6-10'),
(723, 'HARPER BUTTON DOWN PYJAMAS', 'harper-button-down-pyjamas', NULL, 0, NULL, NULL, NULL, NULL, '<p>Spending the weekend in the Harper Satin Two-Piece Pajama Set is the perfect way to recharge your mind after a long week! Soft woven satin shapes this dreamy sleepwear set with a collared neckline, short sleeves with sewn cuffs, and an oversized, button-up bodice accented with a patch pocket which has a cute heart shaped hemming on it. The matching relaxed shorts feature an elasticized waist and two diagonal pockets.<br />\r\nSee size guide below or more information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Material: Satin</p>\r\n\r\n<p>UK Size 8&nbsp;Sleeves 20cm, Bust 104cm, Top Length 65cm, Waist 64-94cm, Hips 104cm, Pant Length 33cm</p>\r\n\r\n<p>Model wears UK size 6<br />\r\n&nbsp;</p>', 2, NULL, 'RZsu3b', NULL, 2, 1, 1, 1, '2020-12-14 16:56:07', '2020-12-17 15:58:17', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Black,UK SIZE 8'),
(724, 'SHANTELLE CROC EMBOSSED PURSE', 'shantelle-croc-embossed-purse', NULL, NULL, NULL, NULL, NULL, NULL, '<p>Every girl has their fave purse, the shantelle croc embossed purse will be yours.</p>\r\n\r\n<ul>\r\n	<li>Material: PU Leather</li>\r\n	<li>Size: L 19cm, H 14cm, W 7cm<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'yWsrQ1', NULL, NULL, 1, 0, 1, '2020-12-14 22:14:05', '2020-12-14 22:14:05', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Structured bag,Croc embossed,Adjustable strap,Small,Blue');
