(725, 'FLORAL RHINESTONE DECOR CLUTCH', 'floral-rhinestone-decor-clutch', NULL, 0, NULL, NULL, NULL, NULL, '<p>Your night (and chic outfit) isn&#39;t complete without the Floral Detailed Clutch! Plain suede shapes a structured box silhouette with a matte black and silver lifting snap closure, elastic accordion sides, and a fully lined interior. Attach the removable gold chain strap for an easy transition from clutch to handbag!</p>\r\n\r\n<ul>\r\n	<li>Material: Suede</li>\r\n</ul>', 2, NULL, 'UOmVLS', NULL, 3, 1, 0, 1, '2020-12-14 22:22:30', '2020-12-15 15:38:48', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Party,Box bag,Plain,Chain strap,Black,Small'),
(726, 'LEIAN  SUEDE BLOCK HEEL COURT SHOE', 'leian-suede-block-heel-court-shoe', NULL, NULL, NULL, NULL, NULL, NULL, '<p>The Leian Block Heel Pumps will take you effortlessly from your 9-5 to date night! These chic pumps have a pointed toe upper, composed of Faux leather that carries into a classic pump silhouette with a mid-cut collar.</p>\r\n\r\n<ul>\r\n	<li>PU Leather/Suede</li>\r\n	<li>Cushioned insole</li>\r\n	<li>inches Wrapped Block Heel<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'T4EOUy', NULL, NULL, 1, 0, 1, '2020-12-15 11:37:02', '2020-12-15 11:37:02', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'PUMPS/COURT SHOE,Mid Heel,Corporates,36,Red'),
(727, 'LEIAN PATENT BLOCK HEEL COURT SHOE', 'leian-patent-block-heel-court-shoe', NULL, 0, NULL, NULL, NULL, NULL, '<p>The Leian Block Heel Pumps will take you effortlessly from your 9-5 to date night! These chic pumps have a pointed toe upper, composed of Faux leather that carries into a classic pump silhouette with a mid-cut collar.</p>\r\n\r\n<ul>\r\n	<li>PU Leather/Suede</li>\r\n	<li>Cushioned insole</li>\r\n	<li>inches Wrapped Block Heel<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'aqmtzw', NULL, 1, 1, 0, 1, '2020-12-15 14:52:01', '2020-12-17 16:07:14', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Mid Heel,Corporates,Red,36'),
(728, 'BIAVA WEDGE SHOE', 'biava-wedge-shoe', NULL, NULL, NULL, NULL, NULL, NULL, '<p>Style and function come together to create the Biava Suede Wedge Pumps! Soft faux suede shapes these chic wedges that have an almond toe upper with a bow tie detail and a pump-inspired silhouette, all atop a tapered wedge heel.</p>\r\n\r\n<ul>\r\n	<li>Suede</li>\r\n	<li>Cushioned Insole</li>\r\n	<li>inches heel</li>\r\n	<li>Nonskid Sole<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'lTyq9L', NULL, NULL, 1, 0, 1, '2020-12-15 14:56:10', '2020-12-15 14:56:10', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'COVER SHOE,Low Heel,Corporates,39,Red'),
(729, 'HEART BUCKLE VINYL BELT', 'heart-buckle-vinyl-belt', NULL, NULL, NULL, NULL, NULL, NULL, '<p>This belt is sure to switch up your outfit of the day. Featuring a clear Vinyl fabric with silver eyelet detailing and buckle. What&#39;s not to love?</p>\r\n\r\n<ul>\r\n	<li>Material: Vinyl</li>\r\n	<li>Closure: Buckle</li>\r\n	<li>Dimension: L W</li>\r\n	<li>One size fits UK 6 - 14</li>\r\n</ul>', 2, NULL, 'q3qaVD', NULL, NULL, 1, 0, 1, '2020-12-15 15:05:15', '2020-12-15 15:05:15', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'HIP,Transparent'),
(730, 'LILY RIBBON DETAILED HAT WITH BLACK TRIM', 'lily-ribbon-detailed-hat-with-black-trim', NULL, 0, NULL, NULL, NULL, NULL, '<p>The HS Lily Ribbon Detailed Woven Hat loves to play it cool! Woven straw in various fantastic colours shapes this absolutely perfect hat with a wide brim and black ribbon accent.</p>\r\n\r\n<ul>\r\n	<li>Material: Paper</li>\r\n</ul>', 2, NULL, '7027xl', NULL, 4, 1, 0, 1, '2020-12-15 15:17:32', '2020-12-15 17:09:24', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Navy Blue,Orange'),
(731, 'LILY RIBBON DETAILED HAT', 'lily-ribbon-detailed-hat', NULL, 0, NULL, NULL, NULL, NULL, '<p>The HS Lily Ribbon Detailed Woven Hat loves to play it cool! Woven straw in various fantastic colours shapes this absolutely perfect hat with a wide brim and grosgrain ribbon accent.</p>\r\n\r\n<ul>\r\n	<li>Material: Paper</li>\r\n</ul>', 2, NULL, 'wyxPf6', NULL, 4, 1, 0, 1, '2020-12-15 15:34:40', '2020-12-15 15:38:34', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Navy Blue,Purple'),
(732, 'TEMMY PLAIN OVERSIZED BEACH HAT', 'temmy-plain-oversized-beach-hat', NULL, NULL, NULL, NULL, NULL, NULL, '<p>All you need is your bikini and the Temmy Plain Oversized Hat for a perfect beach day! This hat will keep you shielded from the sun rays all day, thanks to an oversized brim.</p>\r\n\r\n<p>&nbsp;</p>', 2, NULL, 'ZsLiIH', NULL, NULL, 1, 0, 1, '2020-12-15 15:42:43', '2020-12-15 15:42:43', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Beige'),
(733, 'COWGIRL HAT', 'cowgirl-hat', NULL, NULL, NULL, NULL, NULL, NULL, '<p>Lay out and catch some sun in the Cowgirl Straw Hat! Woven Straw shapes this trendy fedora-style floppy hat with a braided tie at the brim.</p>', 2, NULL, 'AsNXGt', NULL, NULL, 1, 0, 1, '2020-12-15 15:47:23', '2020-12-15 15:47:23', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Black'),
(734, 'ISABELLA PRINT PYJAMAS', 'isabella-print-pyjamas', NULL, 0, NULL, NULL, NULL, NULL, '<p>You&#39;ll want to stay in bed a little longer with the Isabella Floral Print Pajama Set! Lightweight and textured fabric shapes a collared pajama top that has long sleeves and a button-up bodice that ends at a rounded high-low hem with tie-front detail. A front patch pocket lends a classic look. Matching pants have an elasticized waist and flowy pant legs. Orange coloured piping accents the hem of the pants, collar and front pocket of the top. See size guide below or more information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Material: Satin</p>\r\n\r\n<p>UK Size 6/8 Sleeves 20cm, Bust 100cm, Top Length 65cm, Waist 64-94cm, Hips 100cm, Pant Length 96cm</p>\r\n\r\n<p>UK Size 10/12 Sleeves 22cm, Bust 102cm, Top Length 67cm, Waist 64-94cm, Hips 102cm, Pant Length 33cm</p>\r\n\r\n<p>Model wears UK size 6<br />\r\n&nbsp;</p>', 2, NULL, 'O0aeMx', NULL, 2, 1, 1, 1, '2020-12-15 15:55:52', '2020-12-17 16:01:18', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Floral white,UK SIZE 6/8'),
(735, 'PHOEBE NECKLACE', 'phoebe-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>The Phoebe Necklace is so sweet and simple, it goes with everything! Singapore Chain designs shape this necklace and its perfect to wear alone or layered with other necklaces. Necklace comes in 2 colours</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, '7bltjW', NULL, 5, 1, 0, 1, '2020-12-15 19:24:43', '2020-12-17 15:17:31', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,45CM'),
(736, 'AIPRODS CUFF', 'aiprods-cuff', NULL, 0, NULL, NULL, NULL, NULL, '<p>Do your Airpods keep falling off your earlobes?<br />\r\nNot to worry sis, these unique airpod cuffs which also serve as ear cuffs have come to put an end to that.<br />\r\nCute, right?</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Open Cuff</li>\r\n</ul>', 2, NULL, 'LAItke', NULL, 8, 1, 0, 1, '2020-12-15 19:40:37', '2020-12-15 19:41:34', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,Free Size'),
(737, 'HEART DIAMANTE EARRINGS', 'heart-diamante-earrings', NULL, 0, NULL, NULL, NULL, NULL, '<p>Light up the room with the HS Heart Shaped Diamante Earrings! A cluster of sparkly clear rhinestones sit on a heart shaped alloy material (decorated in matching clear rhinestones) . You&#39;re sure to be the centre of attraction at any occasion with these stunning earrings.</p>\r\n\r\n<ul>\r\n	<li>Material: Copper</li>\r\n	<li>Closure: Hinge Back</li>\r\n</ul>', 2, NULL, 'TZBa8D', NULL, 6, 1, 0, 1, '2020-12-15 19:52:03', '2020-12-17 14:41:50', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Gold,Free Size'),
(738, 'HEART MULTICOLOUR BROOCH', 'heart-multicolour-brooch', NULL, NULL, NULL, NULL, NULL, NULL, '<p>Add the perfect amount of femme flair to your dresses and shirts with the Heart Multicolour brooch! Cute multicoloured gem stones adorn this absolutely darling brooch in heart-shaped alloy material.</p>\r\n\r\n<ul>\r\n	<li>Material: Alloy</li>\r\n	<li>Closure: Pin closure</li>\r\n</ul>', 2, NULL, 'tbifZj', NULL, NULL, 1, 0, 1, '2020-12-15 19:55:53', '2020-12-15 19:55:53', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Plated Copper/Alloy,Free Size,Multicolor'),
(739, 'BAILEY CHIC NECKLACE', 'bailey-chic-necklace', NULL, 0, NULL, NULL, NULL, NULL, '<p>Everyone needs a &quot;wear everyday&quot; piece of jewelry and we&#39;ve picked the Bailey Chic Necklace! This unbelievably dainty necklace has a box chain designn and is available in 3 lenghts. Can be worn alone , with a pendant or layered with other necklaces.</p>\r\n\r\n<ul>\r\n	<li>Material: Stainless steel</li>\r\n	<li>Closure: Lobster clasp</li>\r\n</ul>', 2, NULL, 'rsckQF', NULL, 5, 1, 0, 1, '2020-12-18 00:54:40', '2020-12-18 03:11:49', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'Stainless steel,Silver,45CM');
